    "x_studio_property_information": "<p>يقع مشروع القرية الخضراء في غرب العاصمة عمان في منطقة الدبة,من اراضي البحاث والتي تعرف بمنطقة ابو السوس ذات الطبيعة الريفية &nbsp;والجو الهادئ الذي يأخذك الى حيث الاصالة وجمال المنظر وسحر الطبيعة التي تتناغم مع فن البناء الحديث الذي يرتوي من عبق البناء المعماري الحضاري الذي تشتهر به مدينة عمان الحديثة .\n\nويتكون المشروع من خمس وثلاثون فيلا بمساحات مختلفة وتصاميم متعددة روعة في الجمال والرقي وتعتبر التصاميم و التشطيبات الداخلية كما هية الخارجية غاية في التميز الجمالي والراقي\n\n-لن يأخذ منك الكثير من الوقت اذا ما احتفينا بزيارتك الى مشروع (القرية الخضراء) لتقف على جمال الوصف والمظهرو وسحر الطبيعة حيث يبعد ست كيلو مترات جنوب غرب الدوار الثامن\n\n-موقع المشروع المرتفع يمكنك من مشاهدة صورة بانورامية رائعة بإطلالة مفتوحة على جميع الاتجاهات من الغرب الضفة الغربية والبحر الميت ومن الشمال منطقة دابوق والسلط ومن الجنوب مرج الحمام وطريق البحر الميت العدسية اضفنا للمكان جمالا الى جماله\n\n(290 – 380) المساحة\n\nمشروع القريه الخضراء / Green Village / روعة التصاميم الداخليه الحديثه و تشطيبات رويال بمواد اجنبيه رخام ايطالي و سيراميك اسباني و اطقم حمامات ايطاليه و تميز و تفرد بتصميم اعمال الجبصين بتصميمات قمة بالجمال و الهدوء مع مراعاة احتياجات العائله من مساحات داخليه واسعه سواء بغرف النوم او مرافق الفيلا و و غرفة المعيشه المزوده بفايير بليس مصمم بطريقه معاصره و قمه بالجمال و قمنا بمراعاة احتياجاتكم من ماء ساخن و تدفئه حيث ان جميع المشروع مخدوم بشبكة غاز سائل حيث تعمل كل من التدفئه و الماء الساخن الفايير بليس على الغاز و بتوفير مايقارب ال 30% من فواتير الكهرباء .\n\n<strong>ملاحظة ؛ – لمشاهدة الفلل مجانا – يرجى أخذ موعد مسبق </strong>\n\n<strong>دفع عمولة 2% في حال الشـــــــــراء</strong></p>",
