    "x_studio_property_information": "<p>الرونق شقق خياليه بمساحات (٢٠٥ - ٢١٠) متر مربع بارقى مناطق عمان ألغربيه\nالرونق بالقرب من النادي الاهلي ٣ غرف نوم منهم ١ ماستر&nbsp;شرفه خادمه وغسيل وخزين بالاضافة الى غرفه الملابس والجاكوزي .\nديكورات راقيه وحديثه تدفأه مركزيه مع فير بليس الالمنيوم مقطع خاص وزجاج مزدوج&nbsp; الاباجورات مقطع إيطالي تعمل بالكهرباء غاز مركزي. ديكور كامل الأسقف يعكس روعه هندسه التصميم الداخلي والديكور ورق جدران اطقم حمامات فرنسية معلقه ماركت lacico بطاريات برتغالي حجر البناء أفخم انواع الحجر الفلسطيني الجدران معزولة بالكامل بجدار مزدوجة بسماكات ٥٠ سم ابجورات مسحوره بالكامل. مقاطع شورات سيكوريت راءعه فريمات تزين جدران الشقه من الداخل بأسلوب راقي كراج خاص لكل شقه. مصعد بانوراما أبواب امان خارجيه وابواب بلوط داخليه. أرضيات الصالونات والمعيشات بالاضافة الى الممرات والمداخل افخر انواع الرخام الكريما مارفل أرضيات الغرف باركيه إسباني\nبلاط المطابخ والحمامات إسباني نخب اول موديلات حديثه جداً.&nbsp; نظام ستلايت مركزي بست مخارج لكل شقه انتركم دجتل ذكي يعمل بإدخال الشيفرة الخاصه بالقفل او الرقم السري والشاشه الداخليه ٦ إنش ملونه hd فاءقه الوضوح جميع الشقه تحتوي على اناره مخفيه led وسبتات موفره لطاقه الكهرباءيه led مدخل البناء فخم جداً وراقي مكسو بالحجر القباطي الطبيعي بجدارين ديكورية فخمه وواجهات المبنا تحفه معمارية راقيه تطفي الاناقة والجمال على المكان بشموخ معماري\n\n<strong>ملاحظة ؛ – لمشاهدة الشقق مجانا – يرجى أخذ موعد مسبق </strong>\n\n<strong>دفع عمولة 2% في حال الشـــــــــراء</strong></p>",
