    "x_studio_property_information": "<p>يتكون المشروع من خمس فلل متلاصقة ضمن مستوى عالٍ من الخصوصية و التميز، اعلى ربوة من منطقه الظهير (خلف وزارة الخارجيه ) &nbsp;، تبلغ مساحة كل فيلا حوالي 730 م موزعة على أربعة أدوار ( طابق التسوية ،&nbsp; طابق أرضي ، طابق أول ،&nbsp; طابق الروف )&nbsp; المشروع على شارعين 26م و 12 م وتم فتح طريق داخلي جديد على الجهه الشرقيه لخدمه الفلل ، يتوفر مدخل آمن و خاص إلى مواقف السيارات المخصصة لكل فيلا&nbsp; و مجموعة من الحدائق الخاصة بكل فيلا لإعطاء مسحة من الخصوصية للسكان ، يتميز طابق الروف بمساحة أمامية لا تقل عن 100 م .\n\nيتميز هذا المشروع ببناء تصاميم عصريه تعكس روح التجديد في التصميم المعماري ، واجهات حجر التفوح مثبت بشكل كامل بالطريقه الميكانيكيه الخاصه التي تحافظ على شكل الحجر و رونقه عبر الزمن ، و تم عزل كل القواعد و الأساسات و الجدران عزل مائي و حراري و نظام حماية و مراقبة لكل فيلا<strong> .</strong>\n\nارضيات الصالات رخام ايطالي ، تكييف مركزي ، تدفئه تحت البلاط ، نظام شمسي لتسخين الماء ، أجهزة تحكم بالأبواب الرئيسية ، شبابيك مزدوجه عازله ، اباجورات كهربائيه ،&nbsp; مصعد ، 2 جاكوزي ، بئر ماء .\n\n<strong>ملاحظة ؛ – لمشاهدة الفلل مجانا – يرجى أخذ موعد مسبق </strong>\n\n<strong>دفع عمولة 2% في حال الشـــــــــراء</strong></p>",
