    "x_studio_property_information": "<h2>شقق طابقية فخمة بأرقى مناطق جبل عمان</h2>\nبين الدوار الرابع والخامس وبإطلالة مميزة وحي دبلوماسي\n\n260م 4 نوم / 3 نوم بتشطيبات خاصة\n\n<strong>-</strong> الصالون و المعيشة و الممرات (رخام ايطالي)\n\n- الحمامات و المطبخ و غرف النوم (بورسلان ايطالي)\n\n- تكيف مركزي(General)\n\n(Under Floor Heating System)&nbsp; &nbsp;&nbsp;تدفئة تحت البلاط تعمل على الغاز&nbsp; -\n\nالمطبخ والصالون (Smart Home System)-\n\nسويسري (Laufn)-&nbsp; أطقم حمامات\n\n- ألمنيوم البترا:\n\n- مقطع Petra &nbsp;خاص بالسحابات للارتفاعات الاقل من 2 متر .\n\n- مقطع ZEUS &nbsp;خاص بالسحابات للارتفاعات الاقل من 2 متر .\n\n- مقطع EqUIPE الايطالي الخاص بالوحدات الثابتة و المصلات .\n\n- مقطع SCHUCO FW 50+ &nbsp;الألماني المعزول حراريا الخاص بالواجهات CAP SYSTEM&nbsp; &nbsp;بحيث تظهر قواطع ألمنيوم من الداخل و الخارج .\n\n- مقطعSCHUCO AWS/ADS 50 &nbsp;الألماني المعزول حراريا الخاص بالابواب ضمن\n\nالواجهات CW16 , CW10&nbsp; &nbsp;.\n<ul>\n \t<li>نوع باب الكراج قلاب امريكي مع ماتور .</li>\n \t<li>تكون مواصفات الزجاج كالاتي :</li>\n \t<li>لمقطع Petra</li>\n \t<li>اللوائح الدلخلية : سماكة 6 ملم ساده</li>\n \t<li>فراغ الهواء : 6 ملم .</li>\n \t<li>اللوائح الخارجية : سماكة 6 ملم ساده</li>\n \t<li>ابواب خشب جوز</li>\n \t<li>حجر جماعين نخب اول</li>\n \t<li>اباجورات حديد كهربائية</li>\n \t<li>صندوق الاباجورات خارجي</li>\n \t<li>كراج لكل شقة</li>\n \t<li>تنك ماء (سطح + طابق الكراجات)</li>\n \t<li>نظام مراقبة (مدخل الكراج و مدخل البناية الرئيسي) لكل شقة</li>\n \t<li>لكل شقة غرفة خزين .</li>\n</ul>\n&nbsp;\n\n<strong>ملاحظة ؛ – لمشاهدة الشقق مجانا – يرجى أخذ موعد مسبق </strong>\n\n<strong>دفع عمولة 2% في حال الشـــــــــراء</strong>\n\n&nbsp;",
