    "x_studio_property_information": "<p>مساحة الارض 1200 متر سكن (أ) احكام خاصه ، مساحة البناء 1550 متر تتكون من ثلاث طوابق وروف\nطابق التسويه عباره عن شقتين ماسحة كل شقه 2000 متر تتكون كل شقه من غرفتين ومطبخ وحمام وصالون وغرفة معيشه .\nالطابق الارضي عباره عن صالونين حجم كبير (صالون للنساء،وصالون للرجال) ،حمامات ضيوف عدد (22) ، مطبخ ، جناح للنوم مساتر للضيوف، غرفة جلوس مع ترس\nالطابق اول عباره عن 4 غرف نوم ماستر ، صالون كبير ، مطبخ صغير ، غرفة جسله خليجيه ، حمام ضيوف\nالروف عباره عن مكتب خاص (تحكم للفيلا كامله) ، ساونا وبخار وجاكوزي ، حمام تركي ، برنده خارجيه مساحه 250 متر يوجد عليها حدائق معلقه مطله على مدارس الباكالوريا ، قبه سكاي لايت للجاكوزي ،\nبرنده خلفيه مساحه 1500 متر مطله على الحديقه والبرك الخارجيه ، غرفة الجيم الرياضيه ، غرفة سينماء خاصه في القعده ، غرفة الخادمه.\nمواصفات الفيلا\nيوجد مصعد داخلي للفيلا ،، تدفئه تحت البلاط ، بويلرات غاز ، خزان غاز سعته 5 طن ، بئر ماء سعته&nbsp; 85 متر مكعب مياه ، مكيفات معلقه ،بلاط سرميك ، غرف النوم باركيه ، صالونات رخام ،نظام مراقبه كميرات خارجيه (system) كامل حساسات ضد السرقه (نظام امني كامل ) .\nمواصفات اخرى\nبركة سباحه خارجيه ، باربكيو ، شلال ونوافير ، بئر خاص للبركه ، غرفه للمضخات .\nالفيلا جديده لم تسكن بعد\n\n<strong>ملاحظة ؛ – لمشاهدة الفلل مجانا – يرجى أخذ موعد مسبق </strong>\n\n<strong>دفع عمولة 2% في حال الشـــــــــراء</strong></p>",
