    "x_studio_property_information": "<strong>&nbsp;</strong>\n<ol>\n \t<li><strong>الواجهات الحجريه : </strong>حجر رويشد نخب اول 50سم للواجهات الاماميه و 25سم للواجهات الجانبيه وحجر بازلت للبروزات المعمارية ، كافة انواع الحجر مفحوصة مخبريا .</li>\n \t<li><strong>الجدران الخارجيه : </strong>عزل حراري وعزل مائي لكافة الواجهات الخارجية .</li>\n \t<li><strong>البلاط :</strong> سيراميك نخب اول أو رخام او غرانيت صناعي قياس ( 60* 60 ) سم للصالونات والمعيشة وسيراميك باركيه لغرف النوم وسيراميك نخب اول للمطابخ والحمامات .</li>\n \t<li><strong>الرخام : </strong>رخام تركي / ايطالي للمدخل الرئيسي و واجهة المصعد وكذلك للأدراج.</li>\n \t<li><strong>الدهان :</strong>دهان ديلوكس مقاوم للرطوبة وقابل للغسل للجدران ودهان حبيبات للاسقف.</li>\n \t<li><strong>الديكورات :</strong>ديكورات جبصين كرانيش و بحرات للصالونات ، المعيشة ، غرف النوم والمطابخ.</li>\n \t<li><strong>اعمال الالمنيوم :</strong>مقطع خاص للشبابيك مع زجاج مزدوج (Double Glaze) عازل للصوت والحراره وجميع اكسسوارات الاباجورات والشبابيك ذات جودة عالية.</li>\n \t<li><strong>اعمال الحديد :</strong>الباب الخارجي وابواب المداخل الرئيسيه للشقق ابواب امان وحديد دربزينات الادراج باشكال معمارية مميزة .</li>\n \t<li><strong>اعمال المنجور :</strong>ابواب خشبكبسمع قشرة بلوط ودهان لكر ايطالي للابواب الخشبية الداخلية وجميع الاكسسوارات تركية.</li>\n \t<li><strong>التمديدات الصحيه :</strong>جميع التمديدات الصحية وشبكات التدفئه بكس (Pex).</li>\n \t<li><strong>اطقم الحمامات :</strong>كافة اطقم \"الحمامات معلقة\" نوع اسباني / تركي/ ايطالي وكذلك البطاريات وشور بوكس سيكوريت.</li>\n \t<li><strong>التدفئه :</strong>البويلرات والرديترات ايطالي / تركي والحارقات نوع بنتون سويدي.</li>\n \t<li><strong>اعمال الكهرباء</strong> :جميع المفاتيح والاباريز واللوحات الكهربائية سعودية.</li>\n \t<li><strong>خدمات مستقلة لكل شقة</strong> تشمل خزانات ماء عدد 2 بسعة اجمالية 4 م³ .</li>\n \t<li><strong>مصعد كهرباء</strong> نخب اول.</li>\n \t<li><strong>ساتالايت مركزي</strong> .</li>\n</ol>\n<strong>ملاحظة ؛ – لمشاهدة الشقة مجانا – يرجى أخذ موعد مسبق </strong>\n\n<strong>دفع عمولة 2% في حال الشـــــــــراء</strong>",
