    "x_studio_property_information": "<p>فلل متلاصقة للبيع في خلدا ذات اطلالة رائعة على تلة مرتفعة ـ بالقرب من مدارس أكادمية عمان ـ المساحة ٦٥٠ م٢ مكونة من ثلاث طوابق و روف ـــ مساحة الارض 500 متر - ٦ غرف نوم (٤ ماستر) ـ عزل مائي وحراري ـ تدفئة تحت البلاط على الغاز مع بويلر منفصل لكل طابق ونظام تحكم بالحرارة لكل غرفة لوحدها(room by room)ــــ تكييف مركزي منفصل لكل منطقة (samsung invertor )ـ مصعد داخلي لجميع الطوابق ــ sound system ـ security system and cameras ـ spots and hidden lights in all rooms ــ صالون ومدخل رخام كريما مارفل - اطقم حمامات معلقة وبطاريات (ideal standard) - شبابيك دبل جلاس مقطع خاص - باب أمان رئيسي -حديقة امامية وخلفية مع BBQ و شلال - كراج يتسع ٣ سيارات على الكهرباء- بئر ماء ٢٥ م٣ - ديكورات جبسن بورد مميز ــ والمزيد المزيد من المواصفات الرائعة - جديده لم تسكن بعد .\nتقسيمة الفيلا :\nتسوية ( غرفة خادمة وحمام + غرفة غسيل + مستودع+ بئر ماء)\nط أرضي ( صالون وسفرة 100 م٢ + حمام ضيوف + مطبخ+ معيشة + غرفة نوم ماستر )\nط أول ( معيشة + ٤ نوم (٢ماستر) + مطيبخ )روف ( معيشة+ مطيبخ+ غرفة نوم ماستر )</p>",
