    "x_studio_property_information": "<p>مساحة الأرض 520 متر البناء 750 متر\n</p><ol>\n \t<li>بلاط حمامات ايطالي</li>\n</ol>\n30*60&nbsp; او40*40 2. ارضيات الصالونات (بتوشينو) ايطالي&nbsp; بحجم\n<ol start=\"3\">\n \t<li>ارضيات غرف النوم اسباني او ايطالي</li>\n</ol>\nمعلقة الماني ( Duravit) 4. الادوات الصحية\n\n(Grohe/Hansgrohe)5. البطاريات\n<ol start=\"6\">\n \t<li>المصاعد استرا ايطالي و الكبيرة خشب او ستانلس ستيل يخدم 3 طوابق</li>\n \t<li>تدفئة تحت البلاط نوعية الانابيب (فيرسبو)</li>\n \t<li>البويلرات (فيزمان) الماني</li>\n \t<li>ابواب الخشب الداخلية قشرة بلوط او قشرة كرز حسب الاختيار</li>\n \t<li>ايادي الابواب ايطالي او اسباني</li>\n \t<li>انذار مركزي لكل الفيلا</li>\n \t<li>المنيوم (دبل جلاس) مقطع خاص من شركة كلبونة للالمنيوم</li>\n \t<li>بركة سباحة مع اجهزة و معدات ايطالية</li>\n</ol>\n14.ديكورات + اعمال جبصين تشمل جميع مرافق الفيلا\n<ol start=\"15\">\n \t<li>كراج مسقوف تسع سيارتين لكل الفيلا</li>\n \t<li>كاميرات مراقبة لكل الفيلا</li>\n \t<li>اعمال ( الاندسكيبينج)</li>\n \t<li>الباب الرئيسي من ابواب امان الايطالية حديد ملبس خشب</li>\n \t<li>زرفيل الباب الرئيسي ايطالي يقفل ب 14 اتجاه</li>\n \t<li>اباجورات تعمل على الكرباء</li>\n \t<li>تأسيس خط للديزل + تأسيس خط شمسي لتدفئة البركة</li>\n \t<li>قرميد اسباني او برتغالي حسب الاختيار</li>\n \t<li>تأسيس للمكيفات (سبليت يونت) لكل الغرف</li>\n</ol>\n<strong>ملاحظة ؛ - لمشاهدة الفلل مجانا - يرجى أخذ موعد مسبق وهنالك طلب يتم التوقيع عليه بدفع عمولة 2% في حال الشـــــــــراء من قبلكم ( المشتري ).</strong>",
