    "x_studio_property_information": "<strong>موقع العقار</strong>\n\nيقع المشروع أرقى مناطق عبدون الوسطاني خلف نقابه المقاولين الاردنين وبتشطيبات عالية جدا\n\nالمشروع محاط بمجموعه فلل ومباني راقيه كما يمتاز بقربه من الاسواق التجاريه والخدمات الاخرى لحياه عمليه ومريحه\n\n&nbsp;\n\n<strong>مميزات المشروع</strong>\n<ul>\n \t<li>تم تنفيذ المشروع باستخدام أفضل المواد والتجهيزات المطابقة للمواصفات الهندسية العالمية وباشراف هندسي متكامل .</li>\n \t<li>الحجر المستخدم مستورد من فلسطين (الضفه الغربية ) نوعية بيت فجار (نخب أول) مطعم بالجرانيت المستورد (نخب اول)</li>\n \t<li>جدران المبنى الخارجية معزولة حرارياً بالبولسترين للتوفير في استهلاك الطاقه وأرضيات الحمامات معزولة.</li>\n \t<li>الألمونيوم المستعمل ذو مقطع خاص مع زجاج مزدوج عازل للصوت والحراره .</li>\n \t<li>أباجورات الشقة تعمل جميعها بماتورات كهربائية .</li>\n \t<li>أرضيات الصالونات مبلطه برخام ايطالي فاخر نوع بوتوشينو (نخب أول ) والمعيشه والممرات وغرف النوم والمطابخ والحمامات مبلطه بسراميك أجنبي فاخر (نخب أول) .</li>\n \t<li>الأبواب الداخلية والخارجية مصنوعه من قشرة البلوط .</li>\n \t<li>أطقم الحمامات معلقة والبطاريات نوعية (IDEAL STANDARD )</li>\n \t<li>الشقق مزودة بنظام التدفئة تحت البلاط ايطاليه ومزوده ايضا بنظام تكييف مركزي (تدفئه/تبريد) نوع SAMSUNG)) شامل اعمال الدكت والأسقف المستعاره</li>\n \t<li>المبنى مزود بمصعد كهربائي فاخر بأنظمة أمنه ومريحه .</li>\n \t<li>تم تزويد كل شقة بنظام مركزي للستالايت .</li>\n \t<li>لوحة توزيع الكهرباء الرئيسية الداخلية نوعية ( ABB ) والأباريز والمفاتيح نوعية ( AVE ) إيطالية .</li>\n \t<li>كل شقة لها موقف لسيارتين وبئر ماء بطابق القبو وتنك ماء على السطح .</li>\n</ul>\n&nbsp;\n\n<strong>وصف الشكل المعماري الخارجي</strong>\n\nتم تصميم البناء بأفضل المواصفات من قبل المهندس صخر مروان دودين بحيث يراعي فيه حداثة وتميز التصميم المعماري الخارجي والداخلي . تم استخدام الواجهات الزجاجيه الفريده والعصريه مع بلاكين كبيره",
