    "x_studio_property_information": "<span><strong>ارض سكنية مميزة بمساحة&nbsp;٣٧٢ متر مربع في أبو نصير</strong>\n\n&nbsp;\n\nمساحة الارض : ٣٧٢ متر مربع\n\nالموقع : أبو نصير - حي السعادة - بالقرب من مركز أمن أبو نصير - شارع عقلة الشرفات\n\nالسعر : ٩٣٠٠٠ دينار اردني\n\n&nbsp;\n\n<strong>مميزات العقار</strong>\n\n- اإسكان أبو نصير المرحلة الثانية/ الجزء الثالث/ حي السعادة.\n\n- العقار سليخ خالي من البناء والإنشاءات والأشجار، يقع في قرية أبو نصير على شارعين، تقاطع فوزي جرار (من الجهة الجنوبية) مع شارع عقلة الشرفات (من الجهة الشرقية).\n\n- العقار ذو شكل مستطيل منتظم (من الشمال إلى الجنوب)، مخدوم بطريقين معبدين من جهتيه الشرقية والجنوبية.\n\n- العقار يتمتع بواجهتين الأولى ١٥ متر تقريبا (على شارع فوزي جرار) والثانية ٢٥ متر تقريبا (على شارع عقلة الشرفات).\n\n- العقار ذو تربة صخرية تصلح للبناء، وخدمات الماء والكهرباء والصرف الصحي متوفره إليه، ويجاوره أبنية سكنية من الجهة النظيفة.\n\n- العقار مساحته (٣٧٢) متر مربع حسب سند التسجيل، ومنظم (سكن بأحكام خاصة) وبنسبة مئوية تبلغ ٥٨٪ وعدد الأدوار التي يمكن إعمارها عليه ثلاثة أدوار ويقع على شارعين وبالتالي يمكن عمل أكثر من مدخل للبناء وكذلك أكثر من موقف للسيارات ويصلح للإعمار والإسكان.\n\n- العقار مناسب لبناء فيلا مكونة من ثلاثة طوابق أو طابقين وروف، أو لبناء شقق سواء طابقية أو غير طابقية.\n\n- العقار غير مترتب عليه أيه مسقفات أو غرامات أو رسوم أمانة عمان.\n\n- الموقع قريب جدا من الخدمات التجارية والتعليمية والصحية والأسواق وسهل الوصول إليه</span>",
