    "x_studio_property_information": "<h3>شقق 3و4 نوم بإطلالة مميزة في الظهير</h3>\nبموقع مميز ضمن مناطق السكن الخاص\n\nمساحات (250م, 280م)\n\nالمواصفات :\n\n1- التدفئة : تحت البلاط المضخات خزانات التمدد وحدات التدفئة والحارقات وخطوط الماء و بويلرات نوع (EMITTO) ايطالي\n\n2- التكييف مركزي في غرفة المعيشة والصالونات و المطبخ نوع&nbsp; SAMSUNG &nbsp;بالاضافة بالقيام بجميع أعمال التمديدات خطوط الغاز و الكهرباء و تصريف المياه لغرف النوم\n\n3- الابواب قشرة بلوط .\n\n4- الالمنيوم مقطع خاص من شركة الفقير.\n\n5- أطقم الحمامات&nbsp; من النابلسي و العمد.\n\n6- الجبصين Modern &nbsp;مع spot light .\n\n7- مفاتيح و اباريز الكهرباء أيطالي نوع Amir والاسلاك أقل شيء 2.5 ملم والتكييف المركزي 4 ملم .\n\n8- تمديد خط الانترنت و التلفزيون والتلفون واباريز اضافية ومفتاح دركسيون اضافي في كل غرفة .\n\n9- بلاط الصالونات والممرات والمعيشة رخام بيج Barlino ايطالي. وحمام الضيوف رخام.\n\n10- بلاط غرف النوم والمطبخ بورسلان اوروبي.\n\n11- بلاط الحمامات مع غرفة الخادمة أوروبي\n\n12- انتركم كاميرا مع رمز سري.\n\n13- القصارة ودع اسقف وجدران مع تربيع زوايا قائمة .\n\n14- الدهان ديلوكس لون بيج.\n\n15- العزل لترسات الروف طبقة فوم 5سم+3سم اسمنتية +2سم سوكريد و ذلك للعزل الحراري+ رل زفتة سماكة 5ملم + البلاط .وعزل الجدران بولسترين ازرق مضغوط .\n\n16- الطوب بكل انواعه ممون نخب أول و&nbsp; ناجح مخبريا والباطون كسر 250 للأعمدة و العقدات من شركة المناصير.\n\n<strong>ملاحظة ؛ – لمشاهدة الشقق مجانا – يرجى أخذ موعد مسبق </strong>\n\n<strong>دفع عمولة 2% في حال الشـــــــــراء</strong>\n\n&nbsp;",
