    "x_studio_property_information": "<p>&nbsp;\n</p><h3><strong>ارض سكنية مميزة بمساحة 600 م في شفا بدران</strong></h3>\n<strong>المواصفات :&nbsp;</strong>\n\n&nbsp;\n\nالقطعة رقم &nbsp;كوم ياجوز من أراضي شمال عمان - شفا بدران - إسكان القضاة.\n- العقار سليخ خالي من البناء والإنشاءات والأشجار، يقع في قرية بدران على شارع واحد.\n- العقار ذو شكل مربع منتظم، مخدوم بطريق معبد من جهته الشرقية.\n- العقار يتمتع بواجهة واحدة حدها الأدنى 24.5 متر تقريبا.\n- العقار ذو تربة صخرية تصلح للبناء، والخدمات متوفره إليه، ويجاوره أبنية سكنية من الجهة النظيفة.\n- العقار مساحته (600) متر مربع حسب سند التسجيل، ومنظم (سكن ج دون أحكام خاصة) وبنسبة مئوية تبلغ 51 ٪ وعدد الأدوار التي يمكن إعمارها عليه أربعة أدوار ويصلح للإعمار والإسكان.\n- العقار مناسب لبناء فيلا أو لبناء شقق إسكانية، ويجاوره عدة فلل فخمة وأبنية إسكانية.\n- العقار غير مترتب عليه أيه مسقفات أو غرامات أو رسوم أمانة عمان.\n- الموقع قريب جدا من الخدمات التجارية والتعليمية والصحية والأسواق وسهل الوصول إليه.\n- المنطقة هادئة جدا وذات إطلالة مميزة (تقابل جبل ترخيص شمال عمان).\n- القطعة تقع بالقرب من إشارة جامعة العلوم الإسلامية وخلف متنزه الأمير حمزة.\n- العقار مفروز بسند تسجيل خاص به وجاهز للتنازل فورا.\n- العقار يقع في إسكان قضاة الدرجة العليا (قضاة محكمتي التمييز والإدارية العليا).\n- رسوم نقل الملكية وضريبة بيع العقار لدى دائرة الأراضي وأية رسوم إضافية يتحملها المشتري كاملة لوحده\n\n<strong>المساحة :</strong> 600 متر\n\n<strong>السعر :</strong> 123 الف دينار\n\n<strong>الموقع :</strong> شفا بدران - حوض كوم ياجوز - إسكان القضاة - خلف متنزه الأمير حمزة\n\n<strong>ملاحظة ؛ – لمشاهدة الأرض مجانا – يرجى أخذ موعد مسبق </strong>\n\n<strong>دفع عمولة 2% في حال الشـــــــــراء</strong>\n\n&nbsp;",
