    "x_studio_property_information": "<span><strong>شقة 260م دوبلكس مفروشة فرش فاخر\nمرج الحمام منطقة ام السماق خلف السيفوي باتجام طريق المطار\n4 نوم, 2 ماستر\n</strong>\n<b>المواصفات :</b>\n<strong> ١. طابقين بمساحة ١٣٠ متر لكل طابق بدرج دائري داخلي</strong>\n<strong>٢. طابق الاول معلق والثاني على مستوى الارض</strong>\n<strong>٣. مؤثثة باثاث فخم جدا وجديد وتشطيبات وديكورات خاصة مع مطبخ راكب \"طهبوب\"</strong>\n<strong>٤. بالاضاقة الى مساحتها يوجد تراس قرميد خارحي (غرفة ارابسك) اضافة على المساحه</strong>\n<strong>٥. جلسة خارجية مجهزة بكامل اثاث الجلوس بمساحة ٦٠م\nبالاضافة الى شلال مغطاة بديكورات خشب</strong>\n<strong>٦. اباجورات كهربائية ونظام كاميرات امني ولها ٣ مداخل منها مدخل خاص شبه منفصل عن العماره&nbsp;</strong>\n<strong>٧. جناح نوم ماستر وغرفة ملابس وجاكوزي وشاور بوكس بالاضافة الى غرفتين نوم وغرفة خادمة ومستودع وارضيه باركيه ومكيفات لكامل الشقة وتدفئة على الغاز</strong>\n\n<strong>ملاحظة ؛ – لمشاهدة الشقق مجانا – يرجى أخذ موعد مسبق </strong>\n\n<strong>دفع عمولة 2% في حال الشـــــــــراء</strong></span>",
