    "x_studio_property_information": "<p>عرض حصري من قوشان\n</p><div class=\"\">\n<div class=\"_1mf _1mk\"><span>مشروعنا الجديد يتكون من 5 فلل مستقلات . لكل فيلا ارض مستقلة نصف دونم . ومساحة بناء 365 مترمربع . تتألف من 3 طوابق لكل فيلا .</span></div>\n</div>\n<div class=\"\">\n<div class=\"_1mf _1mk\"><span>المشروع يتميز بأمان واستقلالية كبيرة . اذ يوجد مدخل خاص للمشروع .</span></div>\n</div>\n<div class=\"\">\n<div class=\"_1mf _1mk\"><span>يتميز المشروع بأطلالتة الرائعة اذ يوجد واجهات بانوراما على مساحات واسعة . وبتصميمه الخارجي الراقي . والرفاهية ( مسبح - حدائق واسعة - نظام صوتي في كامل الفيلا - home automation ) </span></div>\n</div>\n<div class=\"\">\n<div class=\"_1mf _1mk\"><span>&nbsp;</span></div>\n</div>\n<div class=\"\">\n<div class=\"_1mf _1mk\"><span>يقع المشروع في منطقة الظهير . منطقة سكن احكام خاص . بالقرب من وزارة الخارجية الأردنية . والذي يطل على شارع المطار حيث يعتبر من ابرز شوارع المملكة الذي يؤدي الى مختلف المدن والمناطق بالمملكة . وتبعد عن الدوار السابع 5 دقائق فقط .</span></div>\n</div>\n&nbsp;\n\nتسليم المشروع 1/12/2018\n\nمواصفات التشطيبات :\n\n1- أرضيات من الرخام الفاخر في الصالونات\n2- أرضيات من السيراميك الفاخر في المرافق العامة من تصميم ACG قياس 80*80\n3- سيراميك اسباني في غرف النوم والحمامات\n4- حمامات معلقة \"ideal\"\n5- أطقم بطاريات \"GROHE\"\n6- جبصن بورد في كافة المرافق العامة من الفيلا\n7- المقابس والمفاتيح الكهربائية إيطاليم \"Maatix\"\n8- تدفئة تحت البلاط نوع \"itemme\" في كل فيلا\n9- بويلرات \"biast\" الايطالية\n10- شبابيك ألمنيوم Double Glass مقطع خاص عازل للصوت والحرارة \"عطا رباح\"\n11- أباجورات كهربائية من الألمنيوم مثبت بنهايتها قطعة مطاطية لتغلق بهدوء\n12- كل الجدران والأسقف والطوابق تحتوي على طبقة عزل للصوت والحرارة بتصميم وتنفيذ ضمن أعلى مستوي من مواصفات البناء الأردنية\n13- الأبواب حسب الطلب على أحدث تصميم, مصنوعة من الخشب السويد الصلب مغطى بشرائح الجوز\n14- نظام DASPA الصوتي يصل الى كل ركن من أركان الفيلا ويعمل بعدة مداخل\n15- نظام توليد الكهرباء على الطاقة الشمسية\n16- Home Automation\n\n&nbsp;",
