    "x_studio_property_information": "<p>طريق المطار - الظهير\nمساحة البناء : 1255م مساحة الأرض : 900م سكن (ب) خاص\nالتسوية: شوارات وحمامات للبركة وغرفة ماكينات للبركة, كراجات عدد من (4-5) سيارات, غرفة معيشة مع حمام ومطبخ مجهزكاملاً بغازمع شفاط وفرن نوع ELB الايطالي. غرفة نوم سويت ماستر مع حمام وغرفة ملابس مجهزة كاملاً وفير بليس غرفة خادمة خاصة مع حمام ومطبخ (Dirty kit) مجهز بغاز وشفاط نوع ELBA الايطالي. غرفة حارس وحمامها وغرفة بويلرات وغرفة خزين. الطابق مجهز بتكييف مركزي وتدفئة (رديترات)\n\nالطابق الأرضي: يتكون من صالون وحمام ضيوف وغرفة طعام وغرفة معيشة ومطبخ مجهز كاملاً (غاز مع شفاط وفرن نوع ELBA الايطالي), ثلاجة وميكرويف وفلتر لتنقية المياه RO)), ويوجد ثريات في صالون الضيوف والسفرة وحمام الضيوف.\n\nالطابق الأول: الطابق مكون من 4غرف نوم ماستر. غرفة نوم سويت ماستر عدد2 مجهز بغرفة ملابس كاملة ويوجد فير بليس. غرف نوم ماستر عدد2 مجهزة بخزائن حائط وغرفة ملابس.\n\nالروف: غرفة نوم سويت ماسترمجهزة بغرفة ملابس وفير بليس. مطبخ صغيرمجهزكاملاً بغاز وشفاط وفرن نوع ELBA\nالايطالي. معيشة مجهزة ب(TV unit) وتراسات خارجية.\n\nالمواصفات:\nالألمنيوم (upvc) مقطع خاص من شركة المعماري\nسنترال غاز لبويلرات الغاز والفير بليس عدد6 و مطبخ سنترال غاز عدد3\nبويلرات غاز (condensing) ايطالي من شركة الرذاذ\nمصعد ايطالي بانوراما مع بوابات زجاجية تخدم كل الطوابق\nحجر المبنى من نوع معان سطح نخب أول قياس 50سم\nمطابخ مجهزة كاملاً مع توريد الأجهزة الكهربائية\nبركة خارجية نوع (infinity) مع بركة صغيرة للاطفال مجهزة كاملة نوع ايطالي مع (Heater exchange) مشبوك على البويلر\nالأبواب الداخلية قشرة جوزمع قشاط والباب الرئيسي من نوع الجوز الصولد ويوجد مدخل للفيلا ملبس كاملاً قشرة جوز\n(Solar system) نظام شمسي لتوفير الطاقة الكهربائية مشبوك مع شركة الكهرباء الأردنية مورد من شركة الرذاذ\nالتكييف VRF أمريكي نوع( ( York دكت سبليت لكامل الفيلا. التدفئة Under floor نوع (TUMMY) الايطالي لكامل الفيلا (Room by Room)\nالتسوية رديترات الفيلا مجهزة بكاميرات مراقبة (CCTV) لكامل الاتجاهات والمداخل\nانتركم صورة وصوت( جهاز خارجي عدد1 مع 3 اجهزة داخلية)\nبوابات كهربائية للكراجات والمدخل والرامب تعمل بالريموت كونترول\nسنترال (Net work) لكل الطوابق ويوجد سنترال ستلايت\nأحواض زراعية خشبية وبنشات خشبية.\n\n<strong>ملاحظة ؛ – لمشاهدة الفيلا مجانا – يرجى أخذ موعد مسبق </strong>\n\n<strong>دفع عمولة 2% في حال الشـــــــــراء</strong></p>",
