    "x_studio_property_information": "<h2>شقق بتشطيبات مميزة وبمساحات مختلفة على طريق المطار</h2>\n<strong>المساحات:</strong>\n\n- 250 متر مربع (4 نوم 2 ماستر)\n\n- 210 متر مربع (3 نوم 2 ماستر)\n\nصالون، معيشة، مطبخ، غرفة غسيل وخادمة\n\n<strong>مواصفات الشقق</strong>\n<ul>\n \t<li>حجر خليلي مميز جدا</li>\n \t<li>عزل كامل المبنى</li>\n \t<li>زفتة السطح مع مروحة</li>\n \t<li>تركيب ستالايت مع صحن واصل للغرف مركزي</li>\n \t<li>اباجورات كهرباء</li>\n \t<li>انتركم اوروبي مع كاميرا مع نظام أمان</li>\n \t<li>رخام اورينتال ايطالي نخب اول</li>\n \t<li>تدفئة مركزية</li>\n \t<li>تنكات ماء 4 متر لكل شقة</li>\n \t<li>بلاط حمام اسباني</li>\n \t<li>اطقم حمامات معلقة جروهي</li>\n \t<li>خزائن حمام مع مري مضائة</li>\n \t<li>تاسيس فير بليس</li>\n \t<li>تاسيس غاز للمطبخ</li>\n \t<li>جبصين مودرن كامل الشقة</li>\n \t<li>باركية اسباني للغرف</li>\n \t<li>المنيوم دبل جلاس سبيسر 12 مقطع الفقير</li>\n \t<li>ابواب جوز</li>\n \t<li>مصعد astra ايطالي</li>\n \t<li>بطاريات الماني</li>\n \t<li>واجهة فخمة</li>\n \t<li>طوب وربس جاهز شركة أساس</li>\n \t<li>مصافي ستانلس ستيل</li>\n \t<li>شور بوكس</li>\n \t<li>كراج ومستودع لكل شقة</li>\n</ul>\nمتوفر 3 شقق فقط في الطابق الأول والثاني\n\nالأسعار تبدأ من 160000 دينار\n\n<strong>ملاحظة ؛ – لمشاهدة الشقق مجانا – يرجى أخذ موعد مسبق </strong>\n\n<strong>دفع عمولة 2% في حال الشـــــــــراء</strong>",
