    "x_studio_property_information": "<h2>فلل في دابوق في موقع مطل ومرتفع</h2>\n10 فلل فخمة راقية&nbsp; خلف مدارس المشرق في موقع مطل ومرتفع، تتراوح المساحات بين 500 و 1000 متر.\n\nالمشروع مسور ومحمي وبأعلى المواصفات الأنشائية والتشطيبات ذات الجودة العالية ، ٨ فلل متلاصقة و٢ مستقلات\n\nتتكون من طابق خدمات وطابق ارضي مع حدائق وبركة سباحة وكراجات وطابق ثاني لغرف النوم\n\n<strong>المواصفات الفنية للفلل</strong>\n<ul>\n \t<li>البلاط السيراميك والبورسلان لزوم المطابخ والحمامات صناعة اسبانية</li>\n \t<li>رخام الأرضيات كريما مارفيل تركي قياس 60x60 سم²</li>\n \t<li>الشبابيك والأبواب من مقطع خاص زجاج مزدوج 6+12+6 ملم</li>\n \t<li>بعض الأبواب ستكون من الحديدصاج مزدوج من النوع المميز</li>\n \t<li>الأباجورات من الألمنيوم مزودة بماتورات كهربائية</li>\n \t<li>ديكورات جبسم بورد تصميم حديث في الصالونات وغرف النوم</li>\n \t<li>الأبواب الخشبية الداخلية أبواب جاهزة الصنع مدهونة آلياً بالدهان الإيطالي</li>\n \t<li>الأبواب الخارجية أبواب أمان (مسلحة بالحديد)</li>\n \t<li>الواجهات الحجرية من أجود أنواع الحجر الخليلي وجد (برشت) وطبزة</li>\n \t<li>الحجر للأرضيات حيثما لزم من حجر خليلي (مطبة)</li>\n \t<li>أطقم حمامات معلقة نوع Villeroy and bosh أو ما يعادلها</li>\n \t<li>بطاريات الأطقم نوع ايديال ستاندرد أو جروهي أو هانزا جروهي أو ما يعادلها</li>\n \t<li>التدفئة شبكات تحت البلاط صناعة أوروبية تعمل على الغاز المسال والبويلرات صناعة أوروبية للطابق الأرضي والأول</li>\n \t<li>التكييف: دكت سبليت للطابق الأرضي والأول ووحدات منفصلة لطابق التسوية</li>\n \t<li>عزل الأسطح بمدة ميلان باستعمال جهاز الهيلوكوبتر ووجهيم من الزفتة الساخنة والشمسية</li>\n \t<li>بئر الماء من الباطون المسلح لكل فيلا بسعة لا تقل عن 6م³ وخزان هلى السطح بسعة مترين يعمل على مضخة أوتوماتيك</li>\n \t<li>غاز مركزي مسال للتدفئة والمطبخ والفايربليس</li>\n \t<li>هوم أتوماشين لكامل البيت</li>\n</ul>\nالأسعار تبدأ من 650000 دينار\n\n<strong>ملاحظة ؛ – لمشاهدة الفلل مجانا – يرجى أخذ موعد مسبق </strong>\n\n<strong>دفع عمولة 2% في حال الشـــــــــراء </strong>\n\n&nbsp;",
