    "x_studio_property_information": "<h2>محلات تجارية بمساحات مختلفة للبيع أو للإيجار&nbsp; منطقة الدوار السابع</h2>\nفرصة أستثمارية لا تعوض .\n\nأحجز محلك الأن في&nbsp; في اجمل مواقع عمان .\n\nمشروع تجاري في منطقة الدوار السابع وسط محيط تجاري مميز . و الموقع خلف سيفوي السابع على مفترق شبكة الطرق الرئيسية ، للدوار السابع و طريق المطار و الدوار الثامن.\n<div class=\"text_exposed_show\">\n\nالمشروع جاهز حاليا للتسليم\n\n-عائد سنوي يصل الى 10 % بحد ادنى .\n- تملك محلك بدون رسوم تنازل وبدون نقل ملكية .\n- موقع المشروع في اكثر المناطق حيوية في عمان ومنطقة مرغوبة جدا من الناحية التجارية .\n\nموقع المشروع على 3 شوارع .\n\nمواصفات البناء الخارحي\nتتميز شركة المنشؤون بتقديم كل ماهو جديد من طرق بناء حديثة ومواصفات مميزة ومنها:\n• واجهه بناء مميزه وتصميم هندسي داخلي و خارجي مميز.\n• حجر البناء رويشد نخب اول وحجر كركي من النخب الاول تركيب ميكانيك\n• يتم عزل الحجر الخارجي بماء زجاج فرنسي\n• عزل الاسطح بطبقة فوم اسمنتي سماكة 20سم و طبقة سكريد سماكة 10سم و رولات زفتة على كامل السطح و التصوينات.\n\nمواصفات البناء و توزيعها:\nيتكون المشروع من :\n* الطابق الارضي وينقسم الى 9 محلات تجارية مع سددهم\nمخزن (1) ومساحته 57.5 متر مربع\nمخزن (2) ومساحته 56 متر مربع شامل السده\nمخزن (3) ومساحته 57 متر مربع شامل السده\nمخزن (4) ومساحته 80 متر مربع شامل السده\nمخزن (5) ومساحته 80 متر مربع شامل السده\nمخزن (6) ومساحته 64 متر مربع شامل السده\nمخزن (7) ومساحته 64 متر مربع شامل السده\nمخزن (8) ومساحته 64 متر مربع شامل السده\nمخزن (9) ومساحته 118 متر مربع شامل السده\n\n* طابق التسوية الاولى وينقسم الى 3 محلات تجارية :\nمخزن (10) ومساحته 73 متر مربع\nمخزن (11) ومساحته 162 متر مربع\nمخزن (12) ومساحته 69 متر مربع\n\n* طابق التسوية الثانية و الثالثة تتكون من كراجات وبمساحة 630 متر لكل طابق .\n\n</div>\n<div class=\"text_exposed_show\">\n\nتبدأ الأسعار من ١٩٠ الف دينار\n\nالتأجير من ١٥ الف سنويا\n<p dir=\"RTL\" style=\"text-align: right; direction: rtl; unicode-bidi: embed;\"><strong><span lang=\"AR-SA\">ملاحظة ؛ – لمشاهدة العقار مجانا – يرجى أخذ موعد مسبق </span></strong></p>\n<p dir=\"RTL\" style=\"text-align: right; direction: rtl; unicode-bidi: embed;\"><strong><span lang=\"AR-SA\">دفع عمولة 2% في حال الشـــــــــراء</span></strong></p>\n\n</div>",
