    "x_studio_property_information": "<h2>حصري/ فلل متلاصقة في الظهير ذات جودة عالية ومطلة</h2>\n<strong>مشروع فلل متلاصقة في الظهير (خلف وزارة الخارجية) </strong>\n\n<strong>مساحات الفلل تتراوح ما بين 450 متر – 640 متر</strong>\n<ul>\n \t<li>اطلالة خلابة ومحاطة بالقصور والفلل .</li>\n \t<li>تصاميم معمارية عصرية وفخمة.</li>\n \t<li>تتكون من (تسوية ,طابق ارضي ,طابق اول و روف) مع حديقة خاصة.</li>\n \t<li>تشطيبات سوبر ديلوكس وباعلى المواصفات وباشراف هندسي.</li>\n \t<li>الحجر المستخدم سطح معان نخب أول ، مدماك 25 سم، مطعم بحجر ضبعه.</li>\n \t<li>الشبابيك المنيوم مقطع خاص ، زجاج شفاف دبل –الفراغ 16 ملم.</li>\n \t<li>اباجورات كهربائية ، ماتورات سومفي، والحصيرة فوم</li>\n \t<li>التدفئة المركزية:\n- الدور الارضي والاول تدفئة تحت البلاط تحكم كل غرفة منفصل.\n- التسوية والرووف تدفئة باستخدام الرديترات.\n- البويلر يعمل على السولار (سكب – صناعه بلجيكية)، الحارقة (بنتون).\n- مضخات سويسرية ( بيرال).\n- الانابيب البلاستيكية المانية</li>\n \t<li>التكييف:\n- الطابق الارضي تركيب(Ducted split units).\n- باقي الفيلا تأسيس فقط لوحدات تكييف منفصله ( مواسير نحاس، نقطة كهرباء، خط تصريف).</li>\n \t<li>العزل:\n- الجدران الخارجية بولسترين سماكة 5 سم.\n- الاسطح: فوم مع عزل رولات زفته وبلاط.</li>\n \t<li>الارضيات:\n- الدور الارضي والدرج رخام تركي نخب اول.\n- باقي الارضيات وجدران الحمامات والمطابخ بورسلان وسيراميك اسباني نخب اول.</li>\n \t<li>الابواب:\n- الخارجية الرئيسية ابواب أمان بمواصفات عالية.\n-&nbsp; الداخلية خشب سويد ملبسة قشرة جوز ودهان اجنبي.</li>\n \t<li>اطقم الحمامات اسباني والبطاريات جروهي</li>\n \t<li>نظام تحكم في الفلل(انارة واباجورات) على نظام (knx) ذات منشأ الماني.</li>\n \t<li>المصاعد (PACKAGE-ROOMLESS).</li>\n \t<li>كاميرات مراقبة ونظام حماية من السرقة.</li>\n \t<li>برك سباحة.</li>\n \t<li>موقف سيارات خاص</li>\n \t<li>بئر ماء مستقل</li>\n \t<li>المساحات والأسعار :\nفيلا رقم (2): مساحة الأرض 355م، مساحة البناء 620م بسعر 650000 دينار\nفيلا رقم (3): مساحة الأرض 276م، مساحة البناء 470م بسعر 450000 دينار\nفيلا رقم (4): مساحة الأرض 222م، مساحة البناء 480م بسعر 470000 دينار\nفيلا رقم (5): مساحة الأرض 230م، مساحة البناء 430م بسعر 480000 دينار</li>\n</ul>\n<p dir=\"RTL\" style=\"text-align: right; direction: rtl; unicode-bidi: embed;\"><strong><span lang=\"AR-SA\">ملاحظة ؛ – لمشاهدة العقار مجانا – يرجى أخذ موعد مسبق </span></strong></p>\n<p dir=\"RTL\" style=\"text-align: right; direction: rtl; unicode-bidi: embed;\"><strong><span lang=\"AR-SA\">دفع عمولة 2% في حال الشـــــــــراء</span></strong></p>",
