    "x_studio_property_information": "<h1>شقق مميزة بمساحات 205 - 225 متر في خلدا</h1>\nبالقرب من مسجد الهمشري\n<ul>\n \t<li>205 متر 3 نوم</li>\n \t<li>225 متر 4 نوم</li>\n \t<li>تدفئة مركزية</li>\n \t<li>تكييف مركزي</li>\n \t<li>ارضيات رخام</li>\n \t<li>مقطع المنيوم خاص</li>\n \t<li>اباجورات كهرباء</li>\n \t<li>حمامات معلقة</li>\n \t<li>ديكورات جبصن بورد</li>\n \t<li>مخزن</li>\n \t<li>كراج</li>\n</ul>\nالأسعار:\n<ul>\n \t<li>الارضي مع ترس ٢٢٥م : ٢٢٥ الف</li>\n \t<li>الطابق الاول ٢٢٥م : ٢٠٥ الاف</li>\n \t<li>ارضي مع ترس ٢٠٥م : ٢١٠ الاف</li>\n \t<li>الطابق الاول ٢٠٥م : ١٩٠ الف</li>\n</ul>\n<p dir=\"RTL\" style=\"text-align: right; direction: rtl; unicode-bidi: embed;\"><strong><span lang=\"AR-SA\">ملاحظة ؛ – لمشاهدة العقار مجانا – يرجى أخذ موعد مسبق </span></strong></p>\n<p dir=\"RTL\" style=\"text-align: right; direction: rtl; unicode-bidi: embed;\"><strong><span lang=\"AR-SA\">دفع عمولة 2% في حال الشـــــــــراء</span></strong></p>",
