    "x_studio_property_information": "<h1>فيلا مستقلة بمساحة 460 متر في الظهير</h1>\nفيلا على ارض مستقلة نصف دونم على شارعين. ومساحة بناء 460 مترمربع . تتألف من 3 طوابق\n<div class=\"\">\n<div class=\"_1mf _1mk\"><span>&nbsp;تتميز بأمان واستقلالية كبيرة&nbsp;</span></div>\n</div>\n<div class=\"\">\n<div></div>\n<div class=\"_1mf _1mk\"><span>تتميز الفيلا بأطلالة الرائعة اذ يوجد واجهات بانوراما على مساحات واسعة . وبتصميمها الخارجي الراقي . والرفاهية ( مسبح – حدائق واسعة – نظام صوتي في كامل الفيلا – home automation )</span></div>\n</div>\n<div class=\"\">\n<div class=\"_1mf _1mk\"><span>&nbsp;</span></div>\n</div>\n<div class=\"\">\n<div class=\"_1mf _1mk\"><span>تقع الفيلا في منطقة الظهير . منطقة سكن احكام خاص . بالقرب من وزارة الخارجية الأردنية . تطل على شارع المطار حيث يعتبر من ابرز شوارع المملكة الذي يؤدي الى مختلف المدن والمناطق بالمملكة . وتبعد عن الدوار السابع 5 دقائق فقط .</span></div>\n</div>\nتسليم الفيلا بعد شهرين\n\nمواصفات التشطيبات :\n\n1- أرضيات من الرخام الفاخر في الصالونات\n2- أرضيات من السيراميك الفاخر في المرافق العامة من تصميم ACG قياس 80*80\n3- سيراميك اسباني في غرف النوم والحمامات\n4- حمامات معلقة “ideal”\n5- أطقم بطاريات “GROHE”\n6- جبصن بورد في كافة المرافق العامة من الفيلا\n7- المقابس والمفاتيح الكهربائية إيطاليم “Maatix”\n8- تدفئة تحت البلاط نوع “itemme” في كل فيلا\n9- بويلرات “biast” الايطالية\n10- شبابيك ألمنيوم Double Glass مقطع خاص عازل للصوت والحرارة “عطا رباح”\n11- أباجورات كهربائية من الألمنيوم مثبت بنهايتها قطعة مطاطية لتغلق بهدوء\n12- كل الجدران والأسقف والطوابق تحتوي على طبقة عزل للصوت والحرارة بتصميم وتنفيذ ضمن أعلى مستوي من مواصفات البناء الأردنية\n13- الأبواب حسب الطلب على أحدث تصميم, مصنوعة من الخشب السويد الصلب مغطى بشرائح الجوز\n14- نظام DASPA الصوتي يصل الى كل ركن من أركان الفيلا ويعمل بعدة مداخل\n15- نظام توليد الكهرباء على الطاقة الشمسية\n16- Home Automation\n\nالسعر: 700000 دينار\n\n<strong>ملاحظة ؛ – لمشاهدة العقار مجانا – يرجى أخذ موعد مسبق </strong>\n\n<strong>دفع عمولة 2% في حال الشـــــــــراء</strong>\n\n&nbsp;",
