    "x_studio_property_information": "<h2>شقة طابقية أخير مع رووف بأجمل إطلالة في رجم عميش</h2>\nمساحة الشقة 180 متر والرووف 100 متر\n<ul>\n \t<li><span class=\"text_exposed_show\">موقع المشروع : عمان - ضاحية المهندسين - مقابل رجم عميش - تبعد عن أشارات دير غبار وتاج مول 3 دقائق .</span></li>\n \t<li><span class=\"text_exposed_show\">تقسيمة الشقة من الداخل : صالون ضيوف مع حمام - مطبخ - غرفة معيشة - غرفتين اولاد مع حمام - غرفة ماستر مع حمام - غرفة خادمة مع حمام - مخزن - كراج مستقل .</span></li>\n</ul>\n<span class=\"text_exposed_show\">\n- تتميز الشقة بأطلالة جدا رائعة . ونافذ للشمس من جميع الجهات .\n- تشطيبات داخلية على اعلى مستوى .\n- تصميم خارجي رائع .\n- واجهات بانوراما على مساحات واسعة .\n- تدفئة مركزية .\n- نظام غاز\n- مطبخ راكب من One Kitchen\n</span><span class=\"text_exposed_show\">- نظام صوتي في كل غرفة بالشقة .\n- نظام طاقة شمسية\n</span><span class=\"text_exposed_show\">- كراج مستقل .\n- منطقة جديدة ويتوفر بها جميع الخدمات .</span>\n\nالسعر: 179000 دينار\n<p dir=\"RTL\" style=\"text-align: right; direction: rtl; unicode-bidi: embed;\"><strong><span lang=\"AR-SA\">ملاحظة ؛ – لمشاهدة العقار مجانا – يرجى أخذ موعد مسبق </span></strong></p>\n<p dir=\"RTL\" style=\"text-align: right; direction: rtl; unicode-bidi: embed;\"><strong><span lang=\"AR-SA\">دفع عمولة 2% في حال الشـــــــــراء</span></strong></p>",
