    "x_studio_property_information": "<h2>شقق أرضية 3 و 4 نوم في ضاحية النخيل</h2>\n240م : 4 نوم, 2 ماستر, غرفة خادمة مع حمام\n\n200م : 3 نوم, 1 ماستر, غرفة خادمة مع حمام\n\nالمواصفات:\n– أطلالة جدا مميزة – واجهات بانوراما\n– شكل المشروع الخارجي يتبع نظام modern architecture\n– حجر بيت فجار ِA17\n– رخام اورينتال إيطالي\n– نظام المنازل الذكية home automation\n– نظام صوتي\n– أباجورات كهرباء\n– ديكورات جبسن بورد كامل الشقة في الأسقف و الجدران و الحمامات\n– بواب قشرة جوز\n– مقاطع الألمنيوم دبل عازل صوت وحرارة\n–&nbsp;واجهات زجاجية\n–&nbsp;حمامات معلقة\n– انتركم كاميرا\n– تدفئة ديزل\n– سنترال\n– كراج ومستودع\n– كامل العمارة معزولة بماء زجاج إيطالي\n– خدمة ما بعد البيع و كفالة لمدة سنتين\n\n<strong>&nbsp;المساحات و الاسعار:</strong>\n<ul>\n \t<li>شقق ارضية مع ترسات و مداخل خاصة ٢٠٠م (175 الف)</li>\n \t<li>شقق ارضية مع ترسات و مداخل خاصة&nbsp; ٢٤٠م (195 الف)</li>\n</ul>\n<strong>ملاحظة ؛ – لمشاهدة الشقق مجانا – يرجى أخذ موعد مسبق</strong>\n\n<strong>دفع عمولة 2% في حال الشـــــــــراء</strong>",
