    "x_studio_property_information": "<h2>فيلا مستقلة ذات إطلالة مميزة على طريق المطار</h2>\nفيلا مستقلة على ارض 1000م ومسطح بناء 1400م\n\nالموقع تلعة الذهب طريق المطار منطقه سكان خاص ذات طبيعة عمرانية مميزه من الجمالية والفخامة\n\nالفيلا تتكون من طابقين وروف اضافة الي التسوية ومجهز كالاتي\n\n1.الطابق الأرضي عبارة عن فيلا فلات تتكون من صالة ضيوف واسعة وثلاث غرف نوم ماستر ومطبخ واسع مع صالة سفرة وغرفة معيشة ومخدومة بموقف مغطى يتسع لسيارتين معد لخدمة الطابق الأرضي فقط مع حديقة خلفية واسعة\n\n2. الطابق الاول عبارة عن شقتين مستقلات لهم مدخل مستقل عن الطابق الارضي تتكون كلاهم من ثلاث غرف نوم ومطبخ وصالة ضيوف ولهم مدخل مستقل وموقف مغطى يتسع لسيارتين\n\n3.الروف عبارة عن غرفة نوم ماستر واسعة مع صالة متوسطة الحجم ومطبخ صغير مفتوح على تراس واسع مطل على شارع المطار\n\n4.التسوية مكونة من بركة سباحة وجاكوزي و غرفة نوم ماستر للضيوف وغرفة مكتب مطل على الحديقة ومطبخ واسع <strong>dirty-kitchen&nbsp;</strong>بالاضافة الى الحمامات التي تخدم الصاله الرياضية\n\n<strong> مواصفات الفيلا:</strong>\n<ul>\n \t<li>مصعد كهربائي لجميع الطوابق</li>\n \t<li>البيت مجهز بلكامل بنظام&nbsp;Underfloor heating</li>\n \t<li>اطقم حمامات على اعلى مستوى</li>\n \t<li>رخام ايطالي&nbsp;MARBLE</li>\n \t<li>تجهيزات النوافذ والالمنيوم (المعماري)</li>\n \t<li>جميع ابواب المنزل حتى المخفيه منها من خشب البلوط الصولد</li>\n \t<li>نظام مراقبه واستشعار من جميع اتجاهات المنزل</li>\n</ul>\nالسعر 900000 دينار\n<p dir=\"RTL\" style=\"text-align: right; direction: rtl; unicode-bidi: embed;\"><strong><span lang=\"AR-SA\">ملاحظة ؛ – لمشاهدة العقار مجانا – يرجى أخذ موعد مسبق </span></strong></p>\n<p dir=\"RTL\" style=\"text-align: right; direction: rtl; unicode-bidi: embed;\"><strong><span lang=\"AR-SA\">دفع عمولة 2% في حال الشـــــــــراء</span></strong></p>",
