    "x_studio_property_information": "<h2>شقة مفروشة 220م بإطلالة مميزة في البحر الميت</h2>\nتقع الشقة في أرقى مجتمع سكني على البحر مباشرة مسور ومحمي بالكامل ما بين فندق الهيلتون وفندق الماريوت\n\nمساحة الشقة 220 متر ويميزها تراس 60 متر بإطلالة على البحر مجهز بجلسات خارجية\n\nمواصفات الشقة:\n<ul>\n \t<li>مدخل مستقل</li>\n \t<li>غرفتين نوم مفروشين (1 ماستر)</li>\n \t<li>غرفة ملابس</li>\n \t<li>صالون وسفرة مفروشين بالكامل</li>\n \t<li>مطبخ مجهز بكامل المعدات</li>\n \t<li>3 حمامات</li>\n \t<li>غرفة خادمة</li>\n \t<li>بلاط الحمامات البورسلان ورخام المغاسل عالي الجودة</li>\n</ul>\n<p dir=\"RTL\" style=\"text-align: right; direction: rtl; unicode-bidi: embed;\"><strong><span lang=\"AR-SA\">ملاحظة ؛ – لمشاهدة العقار مجانا – يرجى أخذ موعد مسبق </span></strong></p>\n<p dir=\"RTL\" style=\"text-align: right; direction: rtl; unicode-bidi: embed;\"><strong><span lang=\"AR-SA\">دفع عمولة 2% في حال الشـــــــــراء</span></strong></p>",
