    "x_studio_property_information": "<h2>شقق سكنية فاخرة بمواصفات فلل في رجم عميش</h2>\nذات اطلالة رائعة على كوريدور عبدون\n\nالمشروع في منطقة فلل وقصور ويقع على (3 شوارع) وتنظيم الأرض سكن ( ب ) خاص في منطقة مرتفعة.\n\nالمساحات تبدأ من 250 متر إلى 385 متر كل شقة لها ترس او حديقة مميز ة\n\nتقسيم الشقق :\n\n- مساحة 250متر: عدد 3 غرف نوم (2 ماستر) + مطبخ + معيشة + صالون ضيوف + غرفة خادمة + ترس وفرندة واسعة ومطلة.\n\n- مساحة 385 متر: عدد 4 غرف نوم ( سويت يحتوي على جاكوزي وغرفة ساونا وغرفة ملابس ومطبخ و تأسيس فيربليس ) (1ماستر) صالون ضيوف +مطبخ +Dirty Kitchen+ غرفة معيشة مع تأسيس فيربليس + غرفة خادمة مع حمام + مستودع داخلي + برنده وترسات مطلة.\n<p dir=\"RTL\" style=\"text-align: right; direction: rtl; unicode-bidi: embed;\"><strong><span lang=\"AR-SA\">ملاحظة ؛ – لمشاهدة العقار مجانا – يرجى أخذ موعد مسبق </span></strong></p>\n<p dir=\"RTL\" style=\"text-align: right; direction: rtl; unicode-bidi: embed;\"><strong><span lang=\"AR-SA\">دفع عمولة 2% في حال الشـــــــــراء</span></strong></p>",
