    "x_studio_property_information": "<h2>فيلا 700م في أرقى مناطق مرج الحمام</h2>\nمساحة الأرض 800 م على شارعين\nمساحة البناء 700 م\n<ul>\n \t<li>طابق التسوية: بركة سباحة، جاكوزي، خدمات، مطبخ راكب</li>\n \t<li>الطابق الأرضي: صالونات كبيرة، معيشة، مطبخ راكب</li>\n \t<li>الطابق الأول: معيشة، 4نوم (2 ماستر)، تراسات خارجية</li>\n \t<li>الرووف: غرفة نوم ماستر كبيرة</li>\n</ul>\nالمواصفات:\n- الفيلا مفروشة بالكامل\n- تصميم هندسي خارجي مميز\n- جلسات خارجية (قرميد إيطالي)\n- بوابات خشبية مميزة\n- تدفئة مركزية\n- مكيفات Split units في كل الغرف\n- ديكورات جبسم بورد وأعمال خشبية\n- أباجورات كهرباء\n- جاكوزي عدد 3\n- غرفة حارس\n- غرفة خادمة\n- كهرباء 3 فاز\n- بئر ماء\n- كراجات\n- باربكيو\n\nعمر البناء 9 سنوات\n\nالسعر: 950000 دينار\n<p dir=\"RTL\" style=\"text-align: right; direction: rtl; unicode-bidi: embed;\"><strong><span lang=\"AR-SA\">ملاحظة ؛ – لمشاهدة العقار مجانا – يرجى أخذ موعد مسبق </span></strong></p>\n<p dir=\"RTL\" style=\"text-align: right; direction: rtl; unicode-bidi: embed;\"><strong><span lang=\"AR-SA\">دفع عمولة 2% في حال الشـــــــــراء</span></strong></p>",
