    "x_studio_property_information": "<h2>شقق 350 متر بمواصفات عالية في دابوق</h2>\n4 غرف نوم جميعها ماستر\n\nيقع المشروع في موقع استراتيجي فهو محاط بالعديد من الشوارع الرئيسية المؤدية إلى عمان وضواحيها، بالإضافة إلى قربه من المرافق التعليمية وأهمها مدرسة البكالوريا والمطاعم والنوادي الصحية ومراكز البيع ويبعد فقط 3 دقائق بالسيارة عن سيتي مول.\n\nيحتوي هذا المشروع على 12 شقة بمساحة 350 متر مربع، تتميز كل منها بإطلالة خلابة وتهوية وإنارة طبيعية ممتازة. ثمانية شقق تتمتع بترسات خارجية واسعة وما تبقى من الشقق فيها شرفات واسعة بمساحة 35 متر مربع ومطلة على تلال دابوق الخضراء.\n\nومن المميزات الأخرى وجود خصوصية حيث أن الخدمات المساندة مستقلة عن الشقة، بالإضافة إلى تمتع السكان بحديقة مشتركة في الطابق السفلي بمساحة 70 متر مربع.\n\n<strong>ميزات الشقق:&nbsp;</strong>\n<ul>\n \t<li>نوافذ مقطع UPVC بلجيكي المنشأ من شركة ديكونك مكفول لمدة 25 سنة مع زجاج مزدوج مكفول لمدة 7 سنوات.</li>\n \t<li>أباجورات كهربائية.</li>\n \t<li>بئر ماء بسعة 7 متر مكعب لكل شقة بالإضافة إلى خزان ماء على السطح بسعة 2 متر مكعب.</li>\n \t<li>تكييف مركزي من شركة دايكن مع نظام VRV-IV</li>\n \t<li>تدفئة تحت البلاط.</li>\n \t<li>رخام وبورسلان للأرضيات.</li>\n \t<li>التأسيس لموقد غاز.</li>\n \t<li>شباك سحاب ثلاث درف للشرفات والحدائق.</li>\n</ul>\n<strong>مرافق الشقق:</strong>\n<ul>\n \t<li>موقفين مخصصين لكل شقة، بالإضافة إلى مناطق للتحميل وتنزيل مشتركة بجانب المدخل.</li>\n \t<li>مستودع بمساحة 7 متر مربع لكل شقة في طابق التسوية السادسة.</li>\n \t<li>غرفة مشتركة لإستارحة السائقين بمساحة 37 متر مربع تحتوي على حمام صغير ومطبخ.</li>\n \t<li>ساحة خارجية مشتركة بمساحة 70 متر مربع مع مكان لألعاب الأطفال.</li>\n</ul>\nالأسعار: ابتداءاً من 1100 دينار / للمتر\n<p dir=\"RTL\" style=\"text-align: right; direction: rtl; unicode-bidi: embed;\"><strong><span lang=\"AR-SA\">ملاحظة ؛ – لمشاهدة العقار مجانا – يرجى أخذ موعد مسبق </span></strong></p>\n<p dir=\"RTL\" style=\"text-align: right; direction: rtl; unicode-bidi: embed;\"><strong><span lang=\"AR-SA\">دفع عمولة 2% في حال الشـــــــــراء</span></strong></p>\n&nbsp;",
