    "x_studio_property_information": "<h2>شقة طابق ثالث 138 م بإطلالة مميزة</h2><p style=\"margin-bottom: 0px;\">\nموقع مميز و قريب من الخدمات\n\n<strong>مواصفات الشقه</strong>\n</p><ul>\n \t<li>البنايةاربعة واجهات حجر رويشد نخب اول معزوله بطبقه بولسترين ٣سم وبسماكه ٣٢-٣٥سم للجدار وعزل مائي ألماني.</li>\n \t<li>الشقه تتكون من ( ٣ ) غرف نوم منهم ماستر و ( ٣ ) حمام و غرفه معيشه و غرفه ضيوف و مطبخ.</li>\n \t<li>الاباريز والقواطع والتمديدات الكهربائيه صناعه ( فرنسيه ) ماركه( Legrand ).</li>\n \t<li>أطقم الحمامات (Duravit ) ألمانيه الصنع و الخلطات Kludi الماني.</li>\n \t<li>نظام التدفئه بويلر غاز Ferroli ايطالي.</li>\n \t<li>نظام تكيف مركزي حامي بارد لغرفه المعيشه و الضيوف Samsung وتاسيس باقي الغرف للتمديد المكيفات.</li>\n \t<li>باب الشقه الرئيسي (أمان) عازل للصوت و الحراره و مقاوم للكسر.</li>\n \t<li>ابواب الشقه الداخليه تصنيع خاص قشره جوز.</li>\n \t<li>كامل الارضيات بورسلان اسباني و الجدران للمطابخ و الحمامات سيراميك اسباني نخب اول.</li>\n \t<li>مقطع المنيوم خاص (٦-١٢-٦) أباجورات ألمنيوم وتحكم كهرباء للشبابيك (عطا رباح).</li>\n \t<li>خزان مياه سعه ٢م على السطح و خزان ٢م اسفل العماره مع مضخات و عوامات كهرباء.</li>\n \t<li>كراج سياره مخصص لكل شقه.</li>\n \t<li>غرفه تخزين ٢متر مربع لكل شقه.</li>\n \t<li>كورنيش جبصين في الغرف والحمامات ، و جبسن بورد في المطبخ و المعيشه .</li>\n</ul><p style=\"margin-bottom: 0px;\">\nالسعر 135000 دينار\n</p><p dir=\"RTL\" style=\"text-align: right; direction: rtl; unicode-bidi: embed;\"><strong><span lang=\"AR-SA\">ملاحظة ؛ – لمشاهدة العقار مجانا – يرجى أخذ موعد مسبق </span></strong></p><p dir=\"RTL\" style=\"text-align: right; direction: rtl; unicode-bidi: embed;\"><strong><span lang=\"AR-SA\">دفع عمولة 2% في حال الشـــــــــراء</span></strong></p>",
