    "x_studio_property_information": "<h2>فيلا مستقلة مساحة 500 متر في دابوق</h2>\n<ul>\n \t<li>مشروع مجمع سكني مكون من 10 فلل مستقلة</li>\n \t<li>يبعد 5 دقائق عن دابوق و 3 دقائق عن الفحيص</li>\n \t<li>مصمم ليحافظ على الإطلالات الخضراء الموجودة في المشروع</li>\n \t<li>المشروع مسور ومحمي</li>\n \t<li>سند تسجيل منفصل بالارض مساحة ٥٠٠ متر</li>\n \t<li>خلف مدارس المشرق</li>\n</ul>\nمواصفات الفلل:\n<ul>\n \t<li>مساحة الأرض لكل فيلا 500 متر</li>\n \t<li>جميع الفلل مشرقة ومضيئة طوال الوقت</li>\n \t<li>أعمال إنشائية عالية الجودة وتركيب الحجر ميكانيكيا</li>\n \t<li>تشطيب سوبر ديلوكس</li>\n \t<li>نظام تدفئة تحت البلاط من مجموعة عزت مرجة</li>\n \t<li>نظام Smart Home بتحكم من الهاتف</li>\n \t<li>تكييف مركزي</li>\n \t<li>تتكون من تسوية، طابق أرضي، طابق أول</li>\n</ul>\nالطابق الأرضي: مساحته 180 متر مربع\n<ul>\n \t<li>مساحة مفتوحة بدون أعمدة مكونة من مطبخ واسع ومفتوح على غرفة المعيشة</li>\n \t<li>غرفة معيشة ذات واجهات كبيرة مفتوحة على الساحة الخارجية</li>\n \t<li>غرفة ضيوف وسفرة</li>\n</ul>\nالطابق الأول: مساحته 220 متر مربع\n<ul>\n \t<li>4 غرف نوم ماستر</li>\n \t<li>غرفة معيشة مع تراس واسع ذو إطلالة مميزة</li>\n</ul>\nطابق التسوية: 100 متر مربع\n<ul>\n \t<li>كراج يتسع لسيارتين</li>\n \t<li>مستودع</li>\n \t<li>غرفة خادمات</li>\n \t<li>غرفة غسيل</li>\n</ul>\nالسعر: ابتداءاً من 550000 دينار\n\nالتسليم شهر ١ - ٢٠٢٠\n<p dir=\"RTL\" style=\"text-align: right; direction: rtl; unicode-bidi: embed;\"><strong><span lang=\"AR-SA\">ملاحظة ؛ – لمشاهدة العقار مجانا – يرجى أخذ موعد مسبق </span></strong></p>\n<p dir=\"RTL\" style=\"text-align: right; direction: rtl; unicode-bidi: embed;\"><strong><span lang=\"AR-SA\">دفع عمولة 2% في حال الشـــــــــراء</span></strong></p>",
