    "x_studio_property_information": "<h2>شقق طابقية 350 متر في ناعور- طريق السلام</h2>\nمشروع ذو اطلالة دائمة و محاط بالفلل\n\nمواصفات الشقق:\n* 4 نوم ماستر\n* تشطيب سوبر ديلوكس بجودة عالية جدا تضاهي الفلل\n* حجر خارجي مميز لكامل الاسكان من فلسطين و معزول بالكامل\n* جبسم بورد حديث مع إنارات مخفية.\n* ارضيات رخام اورينتال .\n* أبواب ( أمان ) خارجية عالية المواصفات.\n* ابواب داخلية خشب قشرة (جوز) بمواصفات عالية.\n* شبابيك ألمنيوم مقطع خاص 12ملم.\n* تكيف مركزي\n* أباجورات تعمل على الكهرباء لكامل الشقة.\n* بورسلان اسباني للحمامات + ادوات صحية GROHE\n* مصاعد حديثة بمواصفات عالية.\n* موقف سيارات + مخزن (لكل شقة).\n* انتركم كاميرا\n\nالأسعار:\n<ul>\n \t<li>شبه ارضي : 220 الف</li>\n \t<li>ارضي : 220 الف<strong>(مباع)</strong></li>\n \t<li>اول : 200 الف <strong>(مباع)</strong></li>\n \t<li>ثاني : 220 الف <strong>(مباع)</strong></li>\n \t<li>ثالث : 230 الف <strong>(مباع)</strong></li>\n</ul>\n<p dir=\"RTL\" style=\"text-align: right; direction: rtl; unicode-bidi: embed;\"><strong><span lang=\"AR-SA\">ملاحظة ؛ – لمشاهدة العقار مجانا – يرجى أخذ موعد مسبق </span></strong></p>\n<p dir=\"RTL\" style=\"text-align: right; direction: rtl; unicode-bidi: embed;\"><strong><span lang=\"AR-SA\">دفع عمولة 2% في حال الشـــــــــراء</span></strong></p>",
