    "x_studio_property_information": "<h2>شقق مميزة وبمساحات مختلفة في دير غبار</h2>\n<strong>تتكون الشقق من:</strong>\n<ul>\n \t<li>3 أو 4 غرف نوم</li>\n \t<li>حمام ضيوف وحمام رئيسي مشترك</li>\n \t<li>غرفة غسيل وخادمة مع حمام</li>\n \t<li>خزائن حائطية عدد (2) في الكاردور بين غرف النوم</li>\n \t<li>بلكونة مطلة على المسطحات المائية الرئيسية</li>\n \t<li>صالون ضيوف مع سفرة</li>\n \t<li>صالون معيشة</li>\n \t<li style=\"text-align: right;\">خزائن حائطية عدد (2) في غرف النوم\n<strong>\nمواصفات المشروع:\n- </strong>مساحات 170م، 180م، 190م : 3 غرف نوم (2 ماستر)\n<strong>- </strong>مساحات 215م، 245م : 4 غرف نوم (2 و 3 ماستر)<strong>\n</strong>- المشروع محاط بأسوار بالكامل\n- مبنى إداري مكون من غرفة أمن وحماية مع موظفين أمن على مدار الساعة بالإضافة إلى غرفة انتظار باص المدرسة للأطفال\n- منطقة مجهزة بالكامل بألعاب الأطفال بأعلى معايير السلامة العامة\n- قلب المشروع يتكون من مسطحات مائية واسعة وشلالات ونوافير بالإضافة إلى مسطحات خضراء مع مناطق مخصصة للجلوس وبمواصفات فندقية\n- منطقة مخصصة للرياضة الخارجية مجهزة بالكامل\n- كراجات مريحة وواسعة وبواقع سيارتين لكل شقة.\n- مصلى للرجال ومصلى للنساء بطراز عمراني مميز\n- مستودع مع كل شقة\n- Owners Club ويتكون من:\n1- Lounge فاخر متعدد الاستعمالات\n2- صالة مناسبة فاخرة لجميع المناسبات\n3- مسبح للكبار ومسبح للأطفال\n4- جاكوزي\n5- منطقة مخصصة للمساجات المائية\n6- صالة رياضية مجهزة بالكامل\n7- ساونا وحمام بخار\n8- ملعب سلة وملعب سكواش</li>\n \t<li><strong>المواصفات الفنية:</strong>\n- أبواب أمان تركي مع دخول على البصمة\n- الأبواب الداخلية صولد جوز دهان إيطالي فاخر\n- أرضيات الصالونات والممرات رخام تركي مميز 60*60\n- الشبابيك مقطع PVC دبل جلاس عازل (معماري)\n- أباجورات كهربائية Built In بدون صندوق داخل الشقة\n- نظام تدفئة على الغاز المركزي\n- تأسيس فاير بليس\n- المفاتيح والقواطع الكهربائية نوع شنايدر ألماني\n- أطقم الحمامات والبطاريات Ideal standard\n- أطقم حمامات معلقة\n- شور بوكس راكب\n- ديكورات عصرية مميزة\n- انتركم صوت وصورة ياباني</li>\n</ul>\nالسعر 1100 دينار / المتر\n<p dir=\"RTL\" style=\"text-align: right; direction: rtl; unicode-bidi: embed;\"><strong><span lang=\"AR-SA\">ملاحظة ؛ – لمشاهدة العقار مجانا – يرجى أخذ موعد مسبق </span></strong></p>\n<p dir=\"RTL\" style=\"text-align: right; direction: rtl; unicode-bidi: embed;\"><strong><span lang=\"AR-SA\">دفع عمولة 2% في حال الشـــــــــراء</span></strong></p>",
