    "x_studio_property_information": "<h2>فيلا 660 متر فى أرقى مناطق عبدون</h2>\nبالقرب من النادى الارثوذكسى والسفارة البريطانية\n\nمساحة الارض 1860 مترمربع (قطعتين)، و البناء 660 متر مربع .\n\nمبانى الفيلا على قطعة و كامل الحديقة مع بركة السباحة و توابعها على القطعة الثانية\n\n<strong>تتكون الفيلا من ثلاث طوابق:</strong>\n<ul>\n \t<li>تسوية 82 متر\n- القسم الأول: خدمات غرفة بويلر وخزين و بئرماء داخلى مع غرفة غسيل .\n- القسم الثانى: صالة العاب وجلوس مع تلفزيون (أرضيات من السيراميك) .</li>\n</ul>\n<ul>\n \t<li>الطابق الارضى 311 متر\n- أربع صالونات كبيرة مع موقد حطب كبير fireplace\n- منطقة سفرة كبيرة مع برندة\n- حمام ضيوف\n- مطبخ كبير كامل مع ثلاجات وفرن غاز مع طاولة للطعام&nbsp; وبرندة على البستان\n- ملحق بالمطبخ: غرفة خادمة مع حمام خاص\n- درج داخلى الى التسوية والطابق الاول والسطح\n- مدخل رئيسى من الزجاج السيكوريت ومن ثم الى الباب من خشب البلوط\n- أرضيات الصالونات جميعها من الرخام الايطالى الفاخر والاباجورات على الكهرباء .\n- ديكورات جبصين فاخر</li>\n \t<li>الطابق الاول 206 متر\n- 4 غرف نوم (2 ماستر مع جاكوزي وشورات)\n- برندة واسعة مع قرميد بالكامل\n- منطقة معيشة واسعة مع تلفزيون .\n- جميع غرف النوم مزودة بأجهزة تكييف\n- ديكورات جبصين فاخر</li>\n</ul>\n<strong>مواصفات الفيلا:</strong>\n\n- المبنى مزود&nbsp; بالحماية والانذار\n- كامل الواجهات من الحجر مع قرميد خارجى للديكور\n- كراج مسقوف بالقرميد يتسع لسيارتين مع باب خارجى حديد يعمل بالريموت .\n- القطعة الثانية حديقة مع نافورة مياه عند المدخل وكراج غير مسقوف يتسع لسيارتين\n- بركة سباحة 9x4 متر مع جلسة خاصة وغرفة شاورات\n- لوحة فسفساء كبيرة\n- شلال مياه مضاء\n- غرفة للحارس\n- الحديقة مزروعة بالاشجار مع ساحات كبيرة ومضاءة\n- كامل البناء والحديقة محاطة بالاسوار ومزود بالكهرباء 3 فاز\n- العفش الداخلى من النوع الفاخر مع ثريات كهربائية وبيانو كبير وسجاد فاخر وخزائن مكتبات\n\nالسعر 4,250,000 دينار\n<p dir=\"RTL\" style=\"text-align: right; direction: rtl; unicode-bidi: embed;\"><strong><span lang=\"AR-SA\">ملاحظة ؛ – لمشاهدة العقار مجانا – يرجى أخذ موعد مسبق </span></strong></p>\n<p dir=\"RTL\" style=\"text-align: right; direction: rtl; unicode-bidi: embed;\"><strong><span lang=\"AR-SA\">دفع عمولة 2% في حال الشـــــــــراء</span></strong></p>\n&nbsp;",
