    "x_studio_property_information": "<h2>مشروع شقق قيد الإنشاء 180 م في ضاحية السلام</h2>\nبعد إشارات مرج الحمام بـ600 متر\n\n<strong>مواصفات الشقق:</strong>\n<ul>\n \t<li>3 غرف نوم 1 ماستر</li>\n \t<li>غرفة خادمة كبيرة</li>\n \t<li>حدائق ( باربيكيو مميز+ شلال مائي كبير + ساحة واسعة بديكورات مميزة للشقق الأرضية)</li>\n \t<li>منطقة فلل مميزة</li>\n \t<li>حجر بيت فجار نخب اول</li>\n \t<li>جبسن بورد موديرن مع سبوتات وإنارة مخفية.</li>\n \t<li>تشطيبات فلل ورخام اورينتال ايطالي.</li>\n \t<li>أطقم حمامات فاخرة وسيراميك اسباني نخب اول.</li>\n \t<li>نياجر معلقه جروهي - اباجورات كهرباء.</li>\n \t<li>تدفئة على الغاز</li>\n \t<li>خزائن حمامات - شور بوكس- رديترات سلم ستانلس للحمامات.</li>\n \t<li>تأسيس مكيفات- ستلايت مركزي.</li>\n \t<li>أبواب جوز مميزة جداً وأبواب أمان لمداخل الشقق</li>\n \t<li>الألمنيوم مقطع خاص عازل للحرارة والصوت دبل جلاس.</li>\n \t<li>مصعد astra ايطالي.</li>\n \t<li>كل شقة لها مخزن وكراج خاص بها.</li>\n \t<li>طوب وربس جاهز شركة المناصير</li>\n \t<li>باطون جاهز من شركة لافارج كسر ٢٥٠</li>\n \t<li>كامل العمارة معزولة.</li>\n \t<li>اطلالة دائمة و مميزة</li>\n</ul>\nالأسعار:\n<p dir=\"RTL\" style=\"text-align: right; direction: rtl; unicode-bidi: embed;\"><strong><span lang=\"AR-SA\">ملاحظة ؛ – لمشاهدة العقار مجانا – يرجى أخذ موعد مسبق </span></strong></p>\n<p dir=\"RTL\" style=\"text-align: right; direction: rtl; unicode-bidi: embed;\"><strong><span lang=\"AR-SA\">دفع عمولة 2% في حال الشـــــــــراء</span></strong></p>",
