    "x_studio_property_information": "<h2>فيلا متلاصقة بمنطقة أبو السوس</h2>\n<ul>\n \t<li>الفيلا مكونه من حديقه من ثلاثة جهات مزروعه بأشجار وورود زينة ونظام سقي وشبكة مياه تحت الارض ورشاشات وعشب طبيعي وشلال مياه واناره ملونه وإنارات مخفية لكامل سور البناء وكشفات لكامل الحديقة وكاونتر من الحجر الطبيعي وخزائن وباربكيو وزرب .</li>\n \t<li>اما المبني فهو مؤلف من طابق ارضي وطابقين علويين:\n- الطابق الأرضي :- صالون وسفره وغرفة معيشه وفايربليس وحمام ضيوف ومطبخ فاخر مجهز بالكامل\n- الطابق الاول:- ثلاثة غرف نوم واحده ماستر وحمامين وغرفة معيشة وبرنده .\n- الطابق الثاني:- غرفتين وحمام ومطبخ (كتشنت) وبرنديتين وترس مساحته ٤٨ م٢ و اطلاله جميله على جبال السلط وقلسطين والبحر الميت .</li>\n \t<li>الفيلا مفروشه بالكامل</li>\n \t<li>غرف النوم والأدراج جميعها تحتوي على ديكورات جبسمورد وإنارات مخفية وسبوتات</li>\n \t<li>مجهزة بكميرات مراقبة وحساسات(كاشف حركة) وجهاز إنذار</li>\n</ul>\nالسعر 320000 دينار\n\n<strong>ملاحظة ؛ – لمشاهدة العقار مجانا – يرجى أخذ موعد مسبق </strong>\n\n<strong>دفع عمولة 2% في حال الشـــــــــراء</strong>\n\n&nbsp;",
