    "x_studio_property_information": "<h2>شقق مميزة في أرقى مناطق دابوق</h2>\nيقع المشروع في واحدة من أرقى المواقع في عمان والنابضة بالحياة، في دابوق.\n\nيوفر المبنى إطلالة بانوراميه لا مثيل لها على القصور الملكية والأحياء الراقية في عمان.\n\nومن زاوية أخرى تطلّ على دابوق ومسجد الملك حسين وحدائق الحسين، ومن زاوية أخرى تطل على تلال خلدا الجميلة.\n\nالموقع يسهل الوصول إليه من جميع المواقع الهامة في عمان، ويمتاز بسهولة الوصول إلى طريق المطار والشوارع الرئيسية.\n\nمواصفات المشروع:\n<ul>\n \t<li>مبنى مكون من 7 وحدات مصممة بعناية يقع في منطقة أحكام خاصة</li>\n \t<li>تصميم عصري مع بروزات معمارية متعددة الوظائف</li>\n \t<li>أسقف عالية بارتفاع صافي 330 سم</li>\n \t<li>اباجورات كهربائية مخفية (بدون صندوق اباجور)</li>\n \t<li>مطبخ مفتوح نظام امريكي</li>\n \t<li>مخزن وكراج خاص</li>\n \t<li>غرفة خادمة مع حمام خاص</li>\n \t<li>برندة بطول 3.75 متر ذات اطلالة فريدة بمساحة واسعة ومفتوحة على المعيشة</li>\n \t<li>ممرات خاصة للاحتياجات الخاصة و عربات الأطفال</li>\n \t<li>خط تصريف صحي كبير 20 سم للمجاري خاص بالعمارة فقط و متصل بشكل مباشر مع الخط الرئيسي</li>\n \t<li>خط كهرباء رئيسي ارضي مخفي من المحطة الكهربائية للحي مخصص لتغذية العمارة فقط وساعة 3 فاز لكل شقة بتوزيع احمال متساوي الأنظمة الكهرو ميكانيكية</li>\n \t<li>تكييف مركزي Zone by Zone ياباني من O General من Herma</li>\n \t<li>تهوية ميكانيكية لجميع الحمامات والمطابخ</li>\n \t<li>تدفئة تحت البلاط Uponor Wirsbo Zone by Zone من ATG Daikin وبويلرات غاز عالية الكفاءة CHAPEE</li>\n \t<li>نظام Home Automation أميركي نوع Verda مع نظام حماية من السرقة \"Intrusion Alarm Systems\"</li>\n \t<li>نظام CCTV كاميرات مراقبة HD (حماية) لمداخل العمارة وجميع الخدمات موصولة بلوحة التحكم لكل شقة</li>\n \t<li>نظام ساتلايت مركزي أسباني مزدوج OSN&amp;beIN وسماعات راكبة Honeywell جاهزة لل (Home theater) بالإضافة الى انتركم فيديو خاص لكل شقة</li>\n \t<li>تغذية مياه ميكانيكية مضغوطة مع مخزون مياه سعة 8 م3 لكل شقة</li>\n \t<li>مولد كهربائي احتياطي للمياه والطوارئ</li>\n \t<li>تمديدات للشبكات WLAN مزودة ب3 اجهزة WiFi Repeater لتغطية انترنت قوية لكامل الشقة ومخارجZ-wave وكابينة Server Rack للحفاظ على أجهزة التحكم وموصولة بالfiber internet connection</li>\n \t<li>نظام غاز مركزي ونقاط تغذية متعددة(بويلر تدفئة - مطبخ - فايربليس)</li>\n \t<li>مصعد الماني من Thyssenkrupp Elevator .10</li>\n \t<li>شاحن للسيارة الكهربائية لكل كراج شقة Ev Charging Stations</li>\n \t<li>مفاتيح كهربائية واكسسورات عالمية نوعية (ARTEOR) LEGRAND</li>\n \t<li>حجر معان نخب أول مع عزل سويسري ضد الظروف الجوية</li>\n \t<li>بورسلين سيراميك إيطالي و اسباني Atlas Concorde و Marazzi من \"صلاح شحادة\"</li>\n \t<li>أطقم حمامات فرنسي واسباني نظام معلق من “Roca\"و “Jacob Delafon\" من الكيالي وصلاح شحادة و النظام المعلق للسيفون من Grohe</li>\n \t<li>خلاطات فرنسي وامريكي Jacob Delafon وKOHLER )</li>\n \t<li>ديكورات جبسن بورد بتصميم عصري مميز وعزل حراري وصوتي للجدران الداخلية</li>\n \t<li>عزل حراري ومائي للروف والمناطق الخضراء والحمامات واي منطقة معرضة للظروف المماثلة</li>\n \t<li>عزل تام طبقتين للجدران الخارجية – سماكة 45-55 سم (ثلاث مراحل ,خمس طبقات)</li>\n \t<li>شبابيك نظام فرنسي والمنيوم اعلى صنف مقطع خاص دبل جليز 16 مم مع اباجورات كهربائية Somfy من \"عطا رباح“</li>\n \t<li>اباجورات المنيوم صلبة extruded ضد السرقة مع سيكوريت حماية للأطفال بارتفاع 80 سم</li>\n \t<li>أبواب امان قشرة جوز عالية المواصفات من شركة أبواب الأمان الإيطالية</li>\n \t<li>اضاءة مخفية وسبوتات عصرية لكل غرفة حسب التصميم الداخلي من Osram</li>\n \t<li>أبواب داخلية قشرة جوز عازلة للصوت واعمال النجارة المميزة باكسسوارات عصرية</li>\n</ul>\nالأسعار:\n<ul>\n \t<li>شقة دوبلكس مساحة 580م مع حدائق 300م، 4 غرف نوم (2 ماستر): 585000 دينار</li>\n \t<li>شبه أرضي مساحة 230م مع حديقة 75م، 3 غرف نوم ماستر: 290000 دينار</li>\n \t<li>شقة أرضية مساحة 230م مع حديقة 58م، 3 غرف نوم ماستر: 310000 دينار</li>\n \t<li>طابق أول مساحة 230م، 3 غرف نوم ماستر: 290000 دينار</li>\n</ul>\n<p dir=\"RTL\" style=\"text-align: right; direction: rtl; unicode-bidi: embed;\"><strong><span lang=\"AR-SA\">ملاحظة ؛ – لمشاهدة العقار مجانا – يرجى أخذ موعد مسبق </span></strong></p>\n<p dir=\"RTL\" style=\"text-align: right; direction: rtl; unicode-bidi: embed;\"><strong><span lang=\"AR-SA\">دفع عمولة 2% في حال الشـــــــــراء</span></strong></p>",
