    "x_studio_property_information": "<h2>أخير مع رووف 350 متر في أم أذينة</h2>\nالشقة طابقية\nالرووف : غرفة ٢٥م مع ترسات خارجية ١٧٠م\n\n<strong>مواصفات الشقة:</strong>\n<ul>\n \t<li>٤نوم (٢ماستر)</li>\n \t<li>صالون مع موزع</li>\n \t<li>مطبخ مع تاسيس مواسير غاز</li>\n \t<li>بلكونة للمطبخ</li>\n \t<li>غرفة ضيافه مع حمام خاص</li>\n \t<li>غرفة خادمة مع حمام</li>\n \t<li>غرفة معيشة باطلاله جميلة</li>\n \t<li>غرفتين نوم رئيسيات مع حمام مستقل لكل غرفة</li>\n \t<li>غرفتين نوم اولاد مع حمام خاص</li>\n \t<li>غرفة غسيل</li>\n \t<li>حجر تفوح وعزل مائي وحراري بولسترين عالي الكثافه</li>\n \t<li><span class=\"_3oh- _58nk\">عزل الاسطح رولات زفته 4cm ثم سطح ميلان </span></li>\n \t<li>ابواب قشرة جوز</li>\n \t<li><span class=\"_3oh- _58nk\">تكييف مركزي </span></li>\n \t<li>اباجورات المنيوم معزولة عزل حراري</li>\n \t<li>جاكوزي للحمام الرئيسي</li>\n \t<li><span class=\"_3oh- _58nk\">لوحة كهرباء رئيسية </span></li>\n \t<li>تدفئة مركزية تحت البلاط</li>\n \t<li>أرضيات رخام ماربيل في الصالونات</li>\n \t<li>غرف النوم خشب باركيه حسب الاختيار</li>\n</ul>\nالسعر 435000 دينار\n<p dir=\"RTL\" style=\"text-align: right; direction: rtl; unicode-bidi: embed;\"><strong><span lang=\"AR-SA\">ملاحظة ؛ – لمشاهدة العقار مجانا – يرجى أخذ موعد مسبق </span></strong></p>\n<p dir=\"RTL\" style=\"text-align: right; direction: rtl; unicode-bidi: embed;\"><strong><span lang=\"AR-SA\">دفع عمولة 2% في حال الشـــــــــراء</span></strong></p>",
