    "x_studio_property_information": "<h2>طابق أخير مع رووف تحت الإنشاء في ضاحية النخيل</h2>\nمساحة 200 متر\n\n<strong>مواصفات الشقق:</strong>\n<ul>\n \t<li>غرف نوم ٢ ماستر بالإضافة الى غرفة خادمة كبيرة</li>\n \t<li>الشقق معزول بطبقتين طوب لإعطائها عزل مائي و حراري</li>\n \t<li>منطقة هادئ و مميزة</li>\n \t<li>حجر مصري نخب اول سماكة ٦سم معزول من الداخل و الخارج</li>\n \t<li>قصارة جاهزة من شركة لافارج</li>\n \t<li>طوب وربس جاهز شركة المناصير</li>\n \t<li>باطون جاهز من شركة لافارج كسر ٢٥٠</li>\n \t<li>جبسن بورد موديرن مع سبوتات وإنارة مخفية.</li>\n \t<li>تشطيبات فلل ورخام اورينتال ايطالي.</li>\n \t<li>أطقم حمامات فاخرة بورسلان أسباني نخب اول.</li>\n \t<li>نياجر معلقه جروهي</li>\n \t<li>اباجورات كهرباء</li>\n \t<li>تدفئة على الغاز</li>\n \t<li>خزائن حمامات – شور بوكس- رديترات سلم ستانلس للحمامات.</li>\n \t<li>تأسيس مكيفات- ستاليت مركزي.</li>\n \t<li>أبواب جوز مميزة جداً</li>\n \t<li>أبواب أمان نوع تركي لمداخل الشقق</li>\n \t<li>الألمنيوم مقطع خاص عازل للحرارة والصوت دبل جلاس.</li>\n \t<li>مصعد astra ايطالي.</li>\n \t<li>كل شقة لها مخزن وكراج خاص بها.</li>\n \t<li>كامل العمارة معزولة.</li>\n</ul>\n<strong>الأسعار:&nbsp;</strong>\n\nالطابق الثالث مع روف : 190000 دينار\n<p dir=\"RTL\"><strong><span lang=\"AR-SA\">ملاحظة ؛ – لمشاهدة العقار مجانا – يرجى أخذ موعد مسبق</span></strong></p>\n<p dir=\"RTL\"><strong><span lang=\"AR-SA\">دفع عمولة 2% في حال الشـــــــــراء</span></strong></p>\n\n<div class=\"addtoany_share_save_container addtoany_content addtoany_content_bottom\">\n<div class=\"a2a_kit a2a_kit_size_32 addtoany_list\"></div>\n</div>",
