    "x_studio_property_information": "<h2>أخير مع رووف بأعلى مواصفات التشطيب في الصويفية</h2>\nيقع المشروع على شارعين\n\nمواصفات الشقق:\n<ul>\n \t<li>جميع الشقق ٤ غرف نوم ٢ ماستر.</li>\n \t<li>الحجر المُستخدم حجر ضفة.</li>\n \t<li>رخام ايطالي (Carrara) في الصالونات و غرف الضيوف.</li>\n \t<li>بورسلان اسباني نخب اول (مرقة).</li>\n \t<li>تدفئة تحت البلاط مركزية غاز (de Dietrich)</li>\n \t<li>تمديدات صحية و غاز من شركة عزت مرجي.</li>\n \t<li>تكييف مركزي (General).</li>\n \t<li>اطقم حمامات Villeroy &amp; Boch</li>\n \t<li>بطاريات الحمامات Hansgrohe &amp; Gebiret</li>\n \t<li>المنيوم عازل صوت و حرارة ١٦ملم.</li>\n \t<li>تأسيس Solar System لجميع الشقق.</li>\n \t<li>تأسيس Fireplace غاز لحميع الشقق.</li>\n \t<li>لوحات تحكم كهرباء ايطالية من ABB.</li>\n \t<li>Le Grand electric panels.</li>\n \t<li>واجهات زجاجية و معمارية.</li>\n \t<li>مصعد OTIS.</li>\n \t<li>غرفة خادمة واسعة مع حمام.</li>\n \t<li>اباجورات كهرباء.</li>\n \t<li>غرفة للسائق.</li>\n \t<li>مستودع لكل شقة.</li>\n \t<li>CCTV سامسونج و كاميرات مراقبة في المبنى.</li>\n \t<li>كراجين لكل شقة.</li>\n</ul>\nالأسعار:\n<ul>\n \t<li>اخير مع رووف ٢٨١م بسعر ١٣٧٥ دينار/م.</li>\n</ul>\n<p dir=\"RTL\"><strong><span lang=\"AR-SA\">ملاحظة ؛ – لمشاهدة العقار مجانا – يرجى أخذ موعد مسبق</span></strong></p>\n<p dir=\"RTL\"><strong><span lang=\"AR-SA\">دفع عمولة 2% في حال الشـــــــــراء</span></strong></p>",
