    "x_studio_property_information": "<h2>فيلا مستقلة 570 متر بإطلالة مميزة في دابوق</h2>\nمساحة الارض ٤٨٠ متر\nمساحة البناء ٥٧٠ متر\n\n<strong>تتكون الفيلا من:</strong>\n<ul>\n \t<li>الطابق الارضي: صالونات - غرفة ضيوف و معيشة واسعة - مطبخ مع غرفة طعام خاصة - مكتب - حمام للضيوف.</li>\n \t<li>الطابق الاول: ٤ غرف نوم ٢ ماستر - غرفة معيشة مع مطبخ صغير للخدمات - ترسات خارجية مطلة.</li>\n \t<li>طابق الروف: غرفة نوم + حمام + ترسات خارجية.</li>\n \t<li>طابق التسوية: - طابق الخدمات و المستودعات.</li>\n</ul>\n<strong>مواصفات الفيلا:</strong>\n<ul>\n \t<li>تدفئة مركزية</li>\n \t<li>مطبخ راكب</li>\n \t<li>٥ نوم ٢ ماستر</li>\n \t<li>مقاطع المنيوم خاصة</li>\n \t<li>كراجات نظام امريكي مع اباجورات</li>\n \t<li>مكيفات في كامل الڤيلا</li>\n \t<li>بناء خاص في منطقة احكام خاصة.</li>\n \t<li>حديقة مع بركة سباحة مجهزة.</li>\n \t<li>حديقة مجهزة بالكامل.</li>\n</ul>\nالسعر 690000 دينار\n\n<strong>ملاحظة ؛ – لمشاهدة العقار مجانا – يرجى أخذ موعد مسبق</strong>\n\n<strong>دفع عمولة 2% في حال الشـــــــــراء</strong>",
