    "x_studio_property_information": "<h2>طابق أخير مع رووف 188 متر في الصويفية</h2>\nموقع مميز و حي سكني هادىء بالقرب من المدارس الامريكية\nمساحة الشقة ١٨٨م بالاضافة الى ملحق رووف مع درج داخلي.\n\nالرووف مكون من مطبخ مجهز - غرفة غسيل - حمام - غرفة معيشة واسعة مع ترس خارجي - فاير بليس حطب\n\n<strong>مواصفات الشقة:</strong>\n<ul>\n \t<li>٣ غرف نوم واحدة ماستر</li>\n \t<li>مطبخ راكب من عابدين</li>\n \t<li>٤ حمامات</li>\n \t<li>برندة غربية في الطابق الاساسي</li>\n \t<li>ديكورات و اعمال خشبية</li>\n \t<li>اباجورات كهرباء و اضاءات مخفية في كامل الشقة</li>\n \t<li>ارضيات باركيه جديدة في غرف النوم</li>\n \t<li>ارضيات الصالونات رخام</li>\n</ul>\nالسعر 220000 دينار\n<p dir=\"RTL\"><strong><span lang=\"AR-SA\">ملاحظة ؛ – لمشاهدة العقار مجانا – يرجى أخذ موعد مسبق</span></strong></p>\n<p dir=\"RTL\"><strong><span lang=\"AR-SA\">دفع عمولة 2% في حال الشـــــــــراء</span></strong></p>\n&nbsp;",
