    "x_studio_property_information": "<div class=\"kvgmc6g5 cxmmr5t8 oygrvhab hcukyx3x c1et5uql\">\n<div dir=\"auto\">\n<h2><strong>طابقية مفروشة مع رووف دوبلكس بأجمل إطلالة</strong></h2>\n</div>\n</div>\n<div class=\"o9v6fnle cxmmr5t8 oygrvhab hcukyx3x c1et5uql\">\n<div dir=\"auto\">في أجمل مناطق ناعور المرتفعة وباطلالة مميزة\nبمنطقة هادئة ومخدومة</div>\n<div dir=\"auto\"></div>\n<div dir=\"auto\"><strong>الطابق الأخير 355م طابقي : </strong>صالون كبير, معيشة, مطبخ فخم راكب, 4 نوم (2 ماستر)\nبلكونة واسعة, غرفة خادمة مع حمام</div>\n<div dir=\"auto\"><strong>الرووف 150م داخلي + 100م ترس مجهز : </strong>نظام دوبلكس (درج داخلي), صالون, معيشة\nمطبخ, غرفة نوم, ترس مجهز مع باربكيو</div>\n<div dir=\"auto\"><strong>\n</strong>5 نوم, 2 ماستر, صالون 2, معيشة 2, مطبخ 2, غرفة خادمة\n5 حمامات, بلكونة كبيرة وترسات واسعة</div>\n<div dir=\"auto\"></div>\n</div>\n<div class=\"o9v6fnle cxmmr5t8 oygrvhab hcukyx3x c1et5uql\">\n<div dir=\"auto\">\n<div class=\"kvgmc6g5 cxmmr5t8 oygrvhab hcukyx3x c1et5uql\">\n<div dir=\"auto\"><strong>المواصفات :</strong></div>\n<div dir=\"auto\"><strong>مطبخ كبير راكب مع كامل أجهزته من \"المطبخ الأمريكي\"</strong></div>\n<div dir=\"auto\"><strong>أرضيات رخام إيطالي</strong></div>\n<div dir=\"auto\"><strong>خزائن بالحائط من \"طهبوب\"</strong></div>\n<div dir=\"auto\"><strong>ديكورات جبصن بورد لكامل الشقة</strong>\n<strong>إنارات مخفية</strong></div>\n<div dir=\"auto\"><strong>جزء من الرووف مبني وجزء مسكر بكرميد وتصميم هندسي مميز</strong></div>\n<div dir=\"auto\"><strong>ترس كبير مجهز باطلالة مميزة</strong>\n<strong>مقطع ألمنيوم عازل صوت وحرارة</strong>\n<strong>أباجورات كهرباء</strong>\n<strong>حمامات معلقة\n</strong></div>\n</div>\n<div class=\"o9v6fnle cxmmr5t8 oygrvhab hcukyx3x c1et5uql\">\n<div dir=\"auto\"><strong>العمر : 4 سنوات\n</strong></div>\n<div dir=\"auto\">\n<p dir=\"RTL\"><strong><span lang=\"AR-SA\">ملاحظة ؛ – لمشاهدة العقار مجانا – يرجى أخذ موعد مسبق</span></strong></p>\n<p dir=\"RTL\"><strong><span lang=\"AR-SA\">دفع عمولة 2% في حال الشـــــــــراء</span></strong></p>\n\n</div>\n<div dir=\"auto\"></div>\n</div>\n<div class=\"o9v6fnle cxmmr5t8 oygrvhab hcukyx3x c1et5uql\">\n<div dir=\"auto\"></div>\n</div>\n</div>\n</div>",
