    "x_studio_property_information": "<h2>شقق أرضية مع برك سباحة بمواصفات خاصة في الرابية</h2>\n<div></div>\n<div>في أرقى مناطق الرابية</div>\n<div class=\"kvgmc6g5 cxmmr5t8 oygrvhab hcukyx3x c1et5uql\">مساحة داخلیة 250م/260م\nحدائق كبيرة وبرك خاصة للشقق الارضیة مع دیكورات ممیزة للحدائق\n4نوم (2 ماستر), غرفة خادمة مع حمام</div>\n<div class=\"o9v6fnle cxmmr5t8 oygrvhab hcukyx3x c1et5uql\">أرضیات رخام ایطالي \"Botticino\"\nتكییف مركزي \"Samsumg\"\nتدفئة تحت البلاط على الغاز \"Ferroli\"\nتمدیدات غاز للفیربلیس والمطبخ\nاطقم حمامات معلقة - شوربوكس \"Ideal Standard\"\nنظام منزلي ذكي \"Ave Smart Home System\"\nوحدات انارة موفرة للطاقة \"Philips\"\nمقطع ألمنیوم دبل مقطع خاص\nأباجورات كهرباء من \"الفقير\"\nانتركم كامیرا\nأبواب جوز عالیة الجودة\nعزل مائي وحراري للواجهات الخارجیة والاسطح\nموقف خاص لكل شقة\nتأسیس نقطة كهرباء خاصة لشاحن السیارات الكهربائیة\nغرفه خاصة للسائقین</div>\n<div></div>\n<div>\n<p dir=\"RTL\"><strong><span lang=\"AR-SA\">ملاحظة ؛ – لمشاهدة العقار مجانا – يرجى أخذ موعد مسبق</span></strong></p>\n<p dir=\"RTL\"><strong><span lang=\"AR-SA\">دفع عمولة 2% في حال الشـــــــــراء</span></strong></p>\n\n</div>\n<div></div>",
