    "x_studio_property_information": "<h2>دوبلكس 310م بتشطيبات خاصة في دير غبار</h2>\nيتميز المشروع بمواصفاته الخاصة والتصميم الفاخر\nفي دير غبار بحي هادئ وعلى مقربة من طريق المطار\n\nتتوزع المساحة على طوابق التسوية الأولى والثانية :\nصالون كبير, معيشة, مطبخ راكب بكامل أجهزته مع Dirty Kitchen\n4 نوم(4 ماستر), معيشة, بلكونة كبيرة\n\nالمواصفات الخارجية :\nجدران البناية الخارجية مبنية من الرخام الايطالي “بيرلاتو”\nطوب معزول بالفوم, مكون من طبقتين\n\nالمواصفات الداخلية :\nرخام ايطالي لأرضيات الصالونات وغرف النوم نوع “بوتتشينو” 80*80\nرخام ايطالي لأرضيات الحمامات نوع “بوتتشينو مع دارك ايمبيرادور”\nرخام ايطالي في حمامات الماستر نوع ” كرارا وكلاتكا ابيض”\nجميع الشقق مدعومة بالأنظمة المنزلية الذكية\nتكييف مركزي حامي بارد “Hair”\nتدفئة تحت البلاط وراديترات حائط\nالمبنى مجهز بالكامل بتمديدات الغاز\nشبابيك من الزجاج المقوى العازل للحرارة والصوت (Low-E)\nمقطع خاص 20 للواجهات الرئيسية و16 للواجهات الجانبية\nأباجورات شبابيك كهرباء معزولة (مقلوبة)\nبويلرات غاز ايطالي\nتصميم جبسم بورد حديث مع سبوتات وانارات مخفية\nأبواب أمان لمداخل الشقق وقشرة البلوط للأبواب الداخلية\n<p dir=\"RTL\"><strong><span lang=\"AR-SA\">ملاحظة ؛ – لمشاهدة العقار مجانا – يرجى أخذ موعد مسبق</span></strong></p>\n<p dir=\"RTL\"><strong><span lang=\"AR-SA\">دفع عمولة 2% في حال الشـــــــــراء</span></strong></p>",
