    "x_studio_property_information": "<h2>فيلا بتصميم خاص بأرقى مواقع دابوق</h2>\n<strong>مساحة الارض : 842متر</strong>\n<strong>مساحة البناء&nbsp; : 1275متر</strong>\n\nتتكون من خمسة طوابق\n(تسوية اولى, تسوية ثانية, طابق أرضي, طابق أول, رووف)\n\n<strong>الطابق الأول&nbsp;</strong> &nbsp; &nbsp;<strong>:</strong> معيشة, غرفتين نوم ماستر, ترسات مطلة\n\n<strong>الطابق الأرضي :</strong> صالونات واسعة, غرفة طعام, مطبخ ,ترسات كبيرة باطلالة مميزة, حمام ضيوف\n\n<strong>التسوية الأولى :</strong> معيشة, مطبخ مفتوح, جناح النوم الرئيسي مع حمام كبير وجاكوزي وغرفة ملابس وبرندة\nوجناح غرف الأولاد مكون من غرفتين مع حمام كبير\n\n<strong>التسوية الثانية :</strong> صالة رياضية مكونة من مسبح داخلي فخم وجاكوزي, غرفة ساونا, غرفة بخار, مطبخ صغير\nغرفة غسيل, غرفتين للخدم\n\n<strong>التسوية الثالثة :</strong> صالة سينما, غرفة نوم للزوار, مستودعات, بويلرات\n\n<strong>المواصفات :</strong>\nتدفئة تحت البلاط (ديزل)\nوارضيات ايطالي مستورد\nرخام كوري للدرج\nبالاضافه لرخام ال onix\nارضيات باركيه تصميم مميز\nحدائق مجهزه بالكامل مع باربكيو وبركة سباحة خارجية\nمصعد بانوراما يخدم كامل الفيلا\nغرفة حارس +غرفة سائق\nمستودعات احواض مائيه داخل الفيلا\n<p dir=\"RTL\"><strong><span lang=\"AR-SA\">ملاحظة ؛ – لمشاهدة العقار مجانا – يرجى أخذ موعد مسبق</span></strong></p>\n<p dir=\"RTL\"><strong><span lang=\"AR-SA\">دفع عمولة 2% في حال الشـــــــــراء</span></strong></p>",
