    "x_studio_property_information": "<div class=\"o9v6fnle cxmmr5t8 oygrvhab hcukyx3x c1et5uql ii04i59q\">\n<h2 dir=\"auto\">شقق مميزة بمساحة 185 متر في دير غبار</h2>\n</div>\n<div class=\"o9v6fnle cxmmr5t8 oygrvhab hcukyx3x c1et5uql ii04i59q\">\n<div dir=\"auto\">مواصفات الشقق:</div>\n<ul>\n \t<li dir=\"auto\">3 غرف نوم 1 ماستر بالإضافة الى غرفة خادمة كبيرة</li>\n \t<li dir=\"auto\">الشقق معزولة بطبقتين طوب لإعطائها عزل مائي و حراري و صوتي</li>\n \t<li dir=\"auto\">منطقة هادئة و مميزة</li>\n \t<li dir=\"auto\">حجر مصري (سماحة ) نخب اول سماكة 6سم معزول من الداخل و الخارج</li>\n \t<li dir=\"auto\">تم بناء الحجر بطريقة semi mechanical installation of stone</li>\n \t<li dir=\"auto\">قصارة جاهزة من شركة لافارج</li>\n \t<li dir=\"auto\">طوب وربس جاهز شركة المناصير</li>\n \t<li dir=\"auto\">باطون جاهز من شركة لافارج كسر 250</li>\n \t<li dir=\"auto\">جبسن بورد موديرن مع سبوتات وإنارة مخفية.</li>\n \t<li dir=\"auto\">تشطيبات فلل ورخام اورينتال ايطالي.</li>\n \t<li dir=\"auto\">غرف النوم باركيه اسباني نخب اول قياس 33*133</li>\n \t<li dir=\"auto\">بورسلان نخب اول للحمامات قياس 60*120</li>\n \t<li dir=\"auto\">أطقم حمامات فاخرة و ديكورات جميع الحمامات</li>\n \t<li dir=\"auto\">اباجورات كهرباء</li>\n \t<li dir=\"auto\">نياجر معلقه جروهي -خزائن حمامات - شور بوكس- رديترات سلم ستانلس للحمامات.</li>\n \t<li dir=\"auto\">تأسيس مكيفات</li>\n \t<li dir=\"auto\">ستاليت مركزي.</li>\n \t<li dir=\"auto\">أبواب جوز مميزة جداً</li>\n \t<li dir=\"auto\">أبواب أمان نوع تركي لمداخل الشقق</li>\n \t<li dir=\"auto\">الألمنيوم مقطع خاص عازل للحرارة والصوت دبل جلاس.</li>\n \t<li dir=\"auto\">مصعد astra ايطالي.</li>\n \t<li dir=\"auto\">كل شقة لها مخزن وكراج خاص بها.</li>\n</ul>\n</div>\n<div class=\"o9v6fnle cxmmr5t8 oygrvhab hcukyx3x c1et5uql ii04i59q\">\n<div dir=\"auto\">الأسعار:</div>\n<div dir=\"auto\">\n<ul>\n \t<li class=\"o9v6fnle cxmmr5t8 oygrvhab hcukyx3x c1et5uql\">طابق التسوية : 155 الف دينار</li>\n \t<li class=\"o9v6fnle cxmmr5t8 oygrvhab hcukyx3x c1et5uql\">الطابق شبه الارضي : 160 ألف دينار</li>\n</ul>\n<p dir=\"RTL\"><strong><span lang=\"AR-SA\">ملاحظة ؛ – لمشاهدة العقار مجانا – يرجى أخذ موعد مسبق</span></strong></p>\n<p dir=\"RTL\"><strong><span lang=\"AR-SA\">دفع عمولة 2% في حال الشـــــــــراء</span></strong></p>\n\n</div>\n<div dir=\"auto\"></div>\n<div dir=\"auto\"></div>\n</div>",
