    "x_studio_property_information": "<h2>شقق أرضية 200م مع تراسات وحدائق في أم السماق</h2>\n<strong>مواصفات الشقق:</strong>\n<ul>\n \t<li>3 غرف نوم (1 ماستر)</li>\n \t<li>مصممة بعنايـة نافذة للهواء والشمس من 4 جهات</li>\n \t<li>زجاج دبل جليز مقطع خاص 14 ملم 2</li>\n \t<li>سيراميك وبورسلان إسباني نخب ملم</li>\n \t<li>التدفئة إيطالي تحت البلاط</li>\n \t<li>أسقف جبسن بورد وديكورات فخمة مع إنارة مخفية وسبوتات مخفية لكافة أسقف الشقة</li>\n \t<li>تدفئة على الغاز وغاز مركزي للمطابخ وتوفير نقاط للفير بليس + نقاط المطبخ</li>\n \t<li>جهاز إنذار وحساس للغاز داخل كل الشقة</li>\n \t<li>أباريز الكهرباء AVE نوع دوماس وقواطع الماني</li>\n \t<li>أبواب الشقق امان تركية باهظة وابواب داخلية تركية جاهزة</li>\n \t<li>نظام حماية خاص للعمارة بشكل كامل ( مدخل العمارة , مدخل الكراجات ) على الباسوورد</li>\n \t<li>نظام كاميرات مع كرت شاشة ملون مع كرت تخزين</li>\n \t<li>بلاط الكراجات بلاط اسمنتي مع ديكورات اضاءة في واجهات العمارة والكراجات up-down</li>\n \t<li>كراج ومستودع كبير لكل شقة</li>\n \t<li>إنارة مدخل العمارة والادراج عن طريق حساسات الحركة</li>\n \t<li>تنك ماء علوي وسفلي 2 م مكعب لكل شقة مع مضختين ماء ايطالي</li>\n \t<li>مصعد إسترا ايطالي مكفول</li>\n \t<li>العمارة معزولة بالكامل بوليستر سعودي وماء زجاج فرنسي</li>\n \t<li>حجر العمارة من حجر بيت فجار 50 على كامل واجهات العمارة</li>\n \t<li>أسقف البرندات معزولة upc المقاوم للعوامل الجوية</li>\n \t<li>بروزات معمارية مع سبوتات انارة بتصميم معماري فاخر</li>\n \t<li>شور بوكس نظام فندقي لكل الحمامات مع تركيب خزائن حمام</li>\n \t<li>أطقم حمامات معلقة 21- ستالايت مركزي</li>\n \t<li>أبجاورات كهرباء لكامل الشقة معزولة بالفوم</li>\n \t<li>تصميم لاند سكيب وشلال وتراسات وحدائق للشقة الشبة أرضية</li>\n</ul>\nالأسعار:\n<ul>\n \t<li>شقة أرضية مع تراس أمامي 100 متر 230000 دينار</li>\n \t<li>شبه أرضي مع حديقة أمامية وخلفية 300 متر 230000 دينار</li>\n</ul>\n<p dir=\"RTL\"><strong><span lang=\"AR-SA\">ملاحظة ؛ – لمشاهدة العقار مجانا – يرجى أخذ موعد مسبق</span></strong></p>\n<p dir=\"RTL\"><strong><span lang=\"AR-SA\">دفع عمولة 2% في حال الشـــــــــراء</span></strong></p>",
