    "x_studio_property_information": "<h2>مساحات واسعة في أرقى مناطق عبدون</h2>\n<strong>تشطيبات عالية قرب السفارة الأمريكية وتاج مول</strong>\n\nمساحات : 321م / 221م (4 , 3 نوم)\n\n321م : صالون, معيشة, مطبخ واسع, كراج مستقل\n4 نوم, 4 ماستر بلكونة, غرفة خادمة مع حمام\n\n221م : صالون, معيشة, مطبخ واسع\n3 نوم, 3 ماستر بلكونة, غرفة خادمة مع حمام\n\nتدفئة تحت البلاط\nتكييف مركزي\nأرضيات رخام إيطالي\nمقطع ألمنيوم عازل للصوت والحرارة\nحمامات معلقة\nأباجورات كهرباء\nديكورات جبصن بورد\nمخزن\nكراج\n\n<strong>الأسعار :</strong>\n<ul>\n \t<li>شقة B1 بمساحة 250 متر: 250 ألف دينار</li>\n \t<li>شقة B1 بمساحة 350 متر: 350 ألف دينار</li>\n</ul>\n<p dir=\"RTL\"><strong><span lang=\"AR-SA\">ملاحظة ؛ – لمشاهدة العقار مجانا – يرجى أخذ موعد مسبق</span></strong></p>\n<p dir=\"RTL\"><strong><span lang=\"AR-SA\">دفع عمولة 2% في حال الشـــــــــراء</span></strong></p>",
