    "x_studio_property_information": "<h2>200م مفروشة بالكامل في موقع مميز في خلدا</h2>\nبالقرب من المسجد الهمشري.\nمفروشة بالكامل و لم تُسكن, برندة واسعة. غرفة غسيل\n3 غرف نوم (1 ماستر) / الطابق الثالث\n\nتدفئة مركزية ديزل\nتكييف مركزي في المعيشة.\nوحدات تكييف gree في غرف النوم\nمطبخ راكب مع جميع الاجهزة الكهربائية.\nخزائن بالحائط في جميع الغرف.\n\nحمامات معلقة\nاباجورات كهرباء\nالمنيوم دبل عازل صوت و حرارة\nكراج و مستودع\nموقع مميز في حي هادئ\nعمر البناء سنة واحدة\n\nالسعر : 195 الف دينار\n<p dir=\"RTL\"><strong><span lang=\"AR-SA\">ملاحظة ؛ – لمشاهدة العقار مجانا – يرجى أخذ موعد مسبق</span></strong></p>\n<p dir=\"RTL\"><strong><span lang=\"AR-SA\">دفع عمولة 2% في حال الشـــــــــراء</span></strong></p>",
