    "x_studio_property_information": "<h2>مشروع ڤلل مستقلة تحت الإنشاء في دابوق</h2>\n4 ڤلل مستقلة بمساحة داخلية 575م لكل ڤيلا\n\nموقع مميز يبعد عن الخدمات 3 دقائق\n\nمساحة الارض إبتداءً من 850م الى 1050م\n\nالتسليم بشهر 1/2023\n\n<strong>تتكون كل ڤيلا من طابقين كالآتي:</strong>\n\nطابق التسوية : مساحة 152م داخلي (مساحة خارجية لا تقل عن 150م)\nيتكون من : غرفة معيشة, مطبخ صغير \"Kitchenet\"\nغرفة خادمة مع حمام, غرفة غسيل, غرفة ميكانيك\n\n<strong>الطابق الارضي</strong>: مساحة 200م داخلي (مساحة خارجية لا تقل عن 350م)\nمُصمم ليكون مساحة مفتوحة بدون أعمدة ليعطي حرية في التقطيع\nيتكون من صالون و سفرة و حمام مُطلين على ترسات خارجية\nمطبخ مفتوح على غرفة الجلوس مُطلين على حديقة واسعة\nبالاضافة الى مطبخ ثانوي و غرفة خدمات خارجية.\n\n<strong>الطابق الاول</strong>: مساحة 200م : يتكون من غرفة جلوس\n4 غرف نوم (4 ماستر) بمساحات واسعة.\n\nالمواصفات :\n\nتدفئة تحت البلاط\nتكييف مركزي\nأرضيات رخام\nمقطع ألمنيوم خاص\nأباجورات كهرباء\nحمامات معلقة\nديكورات جبصن بورد\nإنارات مخفية\nحدائق لكلا الطابقين\nبركة سباحة خارجية (4*8م)\n\n<strong>ملاحظة ؛ – لمشاهدة الفلل مجانا – يرجى أخذ موعد مسبق</strong>\n\n<strong>دفع عمولة 2% في حال الشـــــــــراء</strong>\n\n&nbsp;",
