    "x_studio_property_information": "<h2>فيلا مميزة 600 متر في أجمل مواقع الصويفية</h2>\nإجمالي المساحة الداخلية 600 متر مربع\nالمساحة الخارجية 600 متر مربع\nمساحة الارض 875 متر مربع\n\n<strong>الطابق ارضي 275 متر مربع مكون من:</strong>\n<ul>\n \t<li>موزع مربع في المدخل الرئيسي</li>\n \t<li>مكتب في المدخل</li>\n \t<li>صالون كبير</li>\n \t<li>صالة طعام تتسع ل 12 شخص</li>\n \t<li>معيشة تتكون من جلسة مطلة عالحديقة و فاير بليس وركن بيانو</li>\n \t<li>غرفة نوم ماستر</li>\n \t<li>حمام ضيوف وركن مغاسل الضيوف</li>\n \t<li>مطبخ كبير</li>\n</ul>\n<strong>الطابق الثاني 275 متر مربع مكون من:</strong>\n<ul>\n \t<li>صالة معيشة مفتوحة على مطبخ صغير</li>\n \t<li>ركن جيم</li>\n \t<li>مكتبة مع مكتب للقراءة</li>\n \t<li>اربع غرف نوم اثنتان ماستر مع حمامات خاصة</li>\n \t<li>احدها وهو الجناح الرئيسي فيه ترس امامي كبير وغرفة خاصة بالجاكوزي متفرعة من غرفة النوم ومفتوحة عليها مع فاير بليس مشترك بين الغرفة والجاكوزي</li>\n \t<li>حمام يخدم الطابق الثاني</li>\n \t<li>غرفة خادمة مع حمامها الخاص</li>\n</ul>\n<strong>طابق التسوية 50 متر مربع مكون من:</strong>\n<ul>\n \t<li>غرفة مخزن مع رفوف تخزين</li>\n \t<li>غرفة بويلر و غرفة ديزل</li>\n \t<li>حديقة 575 متر مربع</li>\n \t<li>حديقة استقبال امامية 125 متر مربع مزروعة شجر زينة عالي وفيها درج المدخل</li>\n \t<li>حديقة جانبية 150 متر مربع مكونة من ثلاث جلسات مزروعة بالاشجار المثمرة والزينة والنجيل الاخضر</li>\n \t<li>غرفة زجاجية شتوية مغلقة باطلالة بانورامية على الحديقة</li>\n \t<li>ملعب متعدد الاستخدام 150 متر مربع كرة سلة مع بورد كرة قدم مع مرمى كرة طائرة مع شبك</li>\n \t<li>منطقة العاب اطفال ومراجيح مجهزة</li>\n \t<li>ساحة خلفية خلف المطبخ 75 متر مربع تتكون من كرة طاولة خارجية مع تجهيزاتها وخزانة خارجية خاصة لها</li>\n \t<li>منطقة مزروعات نباتات للاستخدام المنزلي اليومي</li>\n \t<li>كراج 75 متر مربع يتسع لاربع سيارات</li>\n \t<li>غرفة خارجية للحارس لها مدخل امامي للساحة الامامية وخلفي للملعب</li>\n</ul>\n<strong>ملاحظة ؛ – لمشاهدة الفلل مجانا – يرجى أخذ موعد مسبق</strong>\n\n<strong>دفع عمولة 2% في حال الشـــــــــراء</strong>",
