    "x_studio_property_information": "<h2>فلل عصرية شبه متلاصقة للبيع على أعلى قمم بدر الجديدة</h2>\nمساحة البناء لكل فيلا 670 متر مربع تقريبا\nمساحة الأرض لكل فيلا 478 متر مربع تقريبا\n\n<strong>مكونات الفيلا:</strong>\n<ul>\n \t<li>4 طوابق: تسوية وأرضي وأول وروف جميعها مخدومة بالمصعد</li>\n \t<li>Otis Room Less Elevator</li>\n \t<li>غرف نوم ماستر 5-6 غرف مع حمامات خاصة وغرف ملابس</li>\n \t<li>حمامات عدد 9 حمامات</li>\n \t<li>عدة صالونات ضيوف والرئيسية بارتفاع سقف 7 متر</li>\n \t<li>غرفة معيشة عدد 3</li>\n \t<li>مطبخ رئيسي واسع جداً ومطبخين فرعيين في الطوابق الأخرى</li>\n \t<li>بركة سباحة مع حمام وشورات خارجية</li>\n \t<li>تراس واسع على الرووف مع شلال جداري من الفسيفساء</li>\n \t<li>غرفة خادمة مع حمامها وكذلك غرفة حارس مع حمام</li>\n \t<li>غرفة غسيل مع ملقف غسيل Laundry Shout</li>\n \t<li>بئر ماء ضخم يتسع لأكثر من 40 متر مكعب</li>\n \t<li>غرفة خزين وصالة ألعاب</li>\n</ul>\n<strong>\nمواصفات خاصة :</strong>\n<ul>\n \t<li>الحجر والعزل :حجر قباطية نخب أول, مداميك 50سم لجميع الواجهات المعزولة حرارياً ومائياً</li>\n \t<li>نظام التدفئة : تدفئة تحت البلاط \"HENGO\" وبويلرات \"De Dietrich\" وأجهزة أمان لكل الشبكة</li>\n \t<li>نظام التكييف : تكييف مركزي صناعة يابانية \"GENERAL\" نفذت من شركة \"عزت مرجي\"</li>\n \t<li>المصعد : مصعد خاص لكل فيلا يخدم جميع الطوابق من نوع \"OTIS\"</li>\n \t<li>الأرضيات : أرضيات وأدراج من الرخام والبورسلان الإيطالي</li>\n \t<li>الحمامات : حمامات معلقة سويسرية \"LAUFEN\" أدوات صحية ألمانية \"GROHE\"</li>\n \t<li>الكهرباء : (3 فاز) وأنظمة إنارة موفرة للطاقة LED .. لوحات كهرباء فرنسية \"legrand\"</li>\n \t<li>نظام تحكم إلكتروني \"Smart Home\"</li>\n \t<li>واجهات الألمنيوم والشبابيك : واجهات كبيرة تصل الى 6 أمتار من \"عطا رباح\" وشبابيك مقطع مزدوج معزول وماتورات أباجورات فرنسية</li>\n \t<li>بركة السباحة : مصنوعة من الفسيفساء الاسبانية مع شلالين ومرافق خاصة (حمام, شاور, مغسل خارجية)</li>\n \t<li>فاير بليس : عدد 2 , فايربليس غاز صناعة أمريكية \"SKY TECH\" والاخر على الحطب صناعة اسبانية \"BRONPI\" بواجهات رخامية وحجرية</li>\n \t<li>أنظمة متطورة : فيديو انتركم \"ABB\" تأسيس وتمديد لكافة الانظمة\n(ستالايت, كاميرات مراقبة, أنظمة أمن وحماية, مقسم تلفون, انترنت مركزي) بالاضافة لوحدة شحن للسيارات الكهربائية</li>\n</ul>\n<p dir=\"RTL\"><strong><span lang=\"AR-SA\">&nbsp; &nbsp; &nbsp;ملاحظة ؛ – لمشاهدة العقار مجانا – يرجى أخذ موعد مسبق</span></strong></p>\n<p dir=\"RTL\"><strong><span lang=\"AR-SA\">&nbsp; &nbsp; &nbsp;دفع عمولة 2% في حال الشـــــــــراء</span></strong></p>",
