    "x_studio_property_information": "<h2>فيلا مستقلة للبيع في أم أذينة</h2>\nمساحة الأرض ٨٤٠م\nالمساحة الداخلية ٥٧٠م\n\nمقسمة على طابقين و روف. مساحة كل طابق ٢٦٥م.\n\nالطابق الارضي مكوّن من: غرفة صالونات واسعة، غرفة طعام، مطبخ، مكتب، غرفة غسيل و غرفة خادمة، حمامين.\n\nالطابق الثاني مكوّن من: غرفة معيشة واسعة، ترسات خارجية، ٤ غرف نوم (٢ ماستر/جناح نوم واسع).\n\nبالاضافة لطابق الروف. مساحات خارجية واسعة للڤيلا بالاضافة لكراجات و بئر ماء و قبو تحت الارض.\n\nالسعر مليون و ٥٠ الف دينار\n<p dir=\"RTL\"><strong><span lang=\"AR-SA\">ملاحظة ؛ – لمشاهدة العقار مجانا – يرجى أخذ موعد مسبق</span></strong></p>\n<p dir=\"RTL\"><strong><span lang=\"AR-SA\">دفع عمولة 2% في حال الشـــــــــراء</span></strong></p>",
