    "x_studio_property_information": "<div class=\"kvgmc6g5 cxmmr5t8 oygrvhab hcukyx3x c1et5uql ii04i59q\">\n<h2 dir=\"auto\">فلل متلاصقة 800م في اجمل مناطق الظهير</h2>\n<div dir=\"auto\"></div>\n<div dir=\"auto\"><strong>كل فيلا مكونة من:</strong></div>\n</div>\n<div class=\"o9v6fnle cxmmr5t8 oygrvhab hcukyx3x c1et5uql ii04i59q\">\n<ul>\n \t<li dir=\"auto\">طابق تسوية ثانية: غرفة بويلرات، غرفة ميكانيك للبركة</li>\n \t<li dir=\"auto\">طابق تسوية اولى: صالونات- بركة سباحة وخدماتها- مخازن - غرفة خادمة - غرفة غسيل.</li>\n \t<li dir=\"auto\">طابق ارضي: صالونات واسعة - غرفة معيشة او نوم- حمام ضيوف -مطبخ واسع.</li>\n \t<li dir=\"auto\">طابق اول: غرفة معيشة رئيسية -غرفة نوم ماستر رئيسية - 2 غرف نوم ماستر.</li>\n \t<li dir=\"auto\">طابق الرووف: صالون -مطبخ - غرفة نوم ماستر -حمام ضيوف -تراسات كبيرة.</li>\n</ul>\n</div>\n<div class=\"o9v6fnle cxmmr5t8 oygrvhab hcukyx3x c1et5uql ii04i59q\">\n<div dir=\"auto\"><strong>المواصفات :</strong></div>\n<ul>\n \t<li dir=\"auto\">حجر سطح معان نخب اول.</li>\n \t<li dir=\"auto\">شبكة تدفئة تحت البلاط وشبكة تمديدات صحية - المجموعة الفنية ATG.</li>\n \t<li dir=\"auto\">بويلرات غاز فرنسية - Chappee - المجموعة الفنية ATG.</li>\n \t<li dir=\"auto\">خزان غاز خارجي محمي ومتصل مع البويلرات والمطابخ - شركة برو غاز.</li>\n \t<li dir=\"auto\">نظام تكييف ياباني Daikin - المجموعة الفنية ATG.</li>\n \t<li dir=\"auto\">رخام اسباني Crema Marfil سماكة 2سم لكامل الصالونات.</li>\n \t<li dir=\"auto\">بلاط ارضيات وحمامات بورسلان اسباني - شركة الراقي للسيراميك.</li>\n \t<li dir=\"auto\">مصعد استرا اسباني - شركة سنقرط.</li>\n \t<li dir=\"auto\">باب رئيسي امان وابواب داخلية من خشب الجوز.</li>\n \t<li dir=\"auto\">شبابيك دبل جلاس مقطع خاص - شركة الفقير الصناعية.</li>\n \t<li dir=\"auto\">اباجورات كهرباء اسباني- شركة وائل محفوظ.</li>\n \t<li dir=\"auto\">بركة السباحة والجاكوزي جميع اجهزتها اسباني.</li>\n \t<li dir=\"auto\">اطقم حمامات وبطاريات ايطالي Ideal Standard-شركة المنى للادوات الصحية</li>\n \t<li dir=\"auto\">ديكورات جبصين وانارة مخفية مميزة .</li>\n \t<li dir=\"auto\">مفاتيح كهرباء ايطالي Matix - Bticino.</li>\n \t<li dir=\"auto\">قواطع كهرباء الماني ABB.</li>\n \t<li dir=\"auto\">دهان ابيض - Dulux.</li>\n \t<li dir=\"auto\">تمديدات لأنظمة مراقبة وأنظمة انذار.</li>\n \t<li dir=\"auto\">كراجات وحدائق خارجية واسعة.</li>\n \t<li dir=\"auto\">بئر ماء.</li>\n</ul>\n</div>\n<div class=\"o9v6fnle cxmmr5t8 oygrvhab hcukyx3x c1et5uql ii04i59q\">\n<div dir=\"auto\">السعر 725000 دينار</div>\n</div>\n<div dir=\"auto\">\n<p dir=\"RTL\"><strong><span lang=\"AR-SA\">ملاحظة ؛ – لمشاهدة العقار مجانا – يرجى أخذ موعد مسبق</span></strong></p>\n<p dir=\"RTL\"><strong><span lang=\"AR-SA\">دفع عمولة 2% في حال الشـــــــــراء</span></strong></p>\n\n</div>",
