    "x_studio_property_information": "<h2>رووف طابقي مع تراسات كبيرة ضمن مشروع محمي ومسور</h2>\nمساحة داخلية من 275م&nbsp; + 150م ترسات\nمدخلين منفصلين مع امكانية التوسعة للمساحة الداخلية\n\n<strong>المواصفات:</strong>\n<ul>\n \t<li>مبنى إداري مكون من غرفة أمن وحماية مع موظفين أمن على مدار الساعة بالإضافة إلى غرفة انتظار باص المدرسة للأطفال\n- منطقة مجهزة بالكامل بألعاب الأطفال بأعلى معايير السلامة العامة\n- قلب المشروع يتكون من مسطحات مائية واسعة وشلالات ونوافير بالإضافة إلى مسطحات خضراء مع مناطق مخصصة للجلوس وبمواصفات فندقية\n- منطقة مخصصة للرياضة الخارجية مجهزة بالكامل\n- كراجات مريحة وواسعة وبواقع سيارتين لكل شقة.\n- مصلى للرجال ومصلى للنساء بطراز عمراني مميز\n- مستودع مع كل شقة\n- Owners Club ويتكون من:\n1- Lounge فاخر متعدد الاستعمالات\n2- صالة مناسبة فاخرة لجميع المناسبات\n3- مسبح للكبار ومسبح للأطفال\n4- جاكوزي\n5- منطقة مخصصة للمساجات المائية\n6- صالة رياضية مجهزة بالكامل\n7- ساونا وحمام بخار\n8- ملعب سلة وملعب سكواش</li>\n \t<li>4 غرف نوم</li>\n \t<li>أبواب أمان تركي مع دخول على البصمة</li>\n \t<li>الأبواب الداخلية صولد جوز دهان إيطالي فاخر</li>\n \t<li>أرضيات الصالونات والممرات رخام تركي مميز 60*60</li>\n \t<li>الشبابيك مقطع PVC دبل جلاس عازل (معماري)</li>\n \t<li>أباجورات كهربائية Built In بدون صندوق داخل الشقة</li>\n \t<li>تدفئة تحت البلاط</li>\n \t<li>تكييف مركزي</li>\n \t<li>نظام تدفئة على الغاز المركزي</li>\n \t<li>تأسيس فاير بليس</li>\n \t<li>المفاتيح والقواطع الكهربائية نوع شنايدر ألماني</li>\n \t<li>أطقم الحمامات والبطاريات Ideal standard</li>\n \t<li>أطقم حمامات معلقة</li>\n \t<li>شور بوكس راكب</li>\n \t<li>ديكورات عصرية مميزة</li>\n \t<li>انتركم صوت وصورة ياباني</li>\n</ul>\n&nbsp;\n<p dir=\"RTL\" style=\"text-align: right; direction: rtl; unicode-bidi: embed;\"><strong><span lang=\"AR-SA\">ملاحظة ؛ – لمشاهدة العقار مجانا – يرجى أخذ موعد مسبق </span></strong></p>\n<p dir=\"RTL\" style=\"text-align: right; direction: rtl; unicode-bidi: embed;\"><strong><span lang=\"AR-SA\">دفع عمولة 2% في حال الشـــــــــراء</span></strong></p>",
