    "x_studio_property_information": "<h2>شقق تحت الانشاء في اجمل مواقع دير غبار</h2>\n<strong>المساحات:</strong>\n<ul>\n \t<li>\n \t</li><li>255 متر : أربع غرف نوم (2 ماستر)، غرفة غسيل، غرفة خادمة مع حمام،مطبخ، حمام ضيوف\nحمام أولاد، معيشة مع ركن افطار، صالون، برندة</li>\n</ul>\n<strong>المواصفات:</strong>\n<ul>\n \t<li>تشكيلات حجر مميزة لواجهات العمارة مع ديكورات الحجر</li>\n \t<li>نوع الحجر رويشد أبيض نخب أول</li>\n \t<li>مفاتيح الكهرباء نوع شنايدر أوروبي أو ما يماثلها ولوحة القواطع نوع لوجراند فرنسي، التمديد نظام لوب</li>\n \t<li>الشقق مزودة بنظام تكييف مركزي LG-Inverter أو Samaung-Inverter دكت للصالون والمعيشة والمطبخ مع تأسيس مكيفات في باقي الغرف</li>\n \t<li>فيديوفون للشقق صوت وصورة للشقق مع الانتركم نوع تركي مكفول سنة</li>\n \t<li>أبواب الخشب الداخلية والخارجية قشرة جوز مع دهان لون جوزي</li>\n \t<li>زرافيل الأبواب سلندر إيطالي والأيادي سلفر والباب الخارجي باب أمان</li>\n \t<li>أرضيات الصالونات والمعيشة والموزع الرئيسي رخام تركي أو إيطالي لون بيج</li>\n \t<li>سيراميك أرضيات غرف النوم مع الموزعات اسباني نخب أول وسيراميك جدران وأرضيات الحمامات والمطبخ إيطالي أو اسباني من الأنواع الجيدة</li>\n \t<li>براطيش الشبابيك رخام نخب اول ودرج العمارة رخام لون بيج</li>\n \t<li>أطقم الحمامات معلقة نوع اسباني Roca أو ما يماثلها والخادمة تركي وبوكس شور لحمام الرئيسي الأول فقط</li>\n \t<li>بطاريات الحمامات فيوري إيطالي أو ما يماثلها كفالتها 3 سنوات</li>\n \t<li>نظام التدفئة تحت البلاط والتدفئة تعمل على الغاز، نظام الغاز حسب مواصفات واشراف وشروط شركة بروغاز</li>\n \t<li>النوافذ مقطع خاص عريض مع زجاج مزدوج والزجاج أبيض والأباجور ألمنيوم مع فوم وجميع الأباجورات مزودة بموتورات كهرباء مكفولة خمس سنوات</li>\n \t<li>ديكورات الجبصين كرانيش أو انارة مخفية مع سقف مستعار للصالونات والمعيشة والنوم الرئيسية الأولى ويكون الموزع جبصين ولجميع غرف النوم كورنيش جبصين</li>\n \t<li>تأسيس فايربليس غاز لكل شقة</li>\n \t<li>مصعد نوع جيد مع اشراف هندسي مكفول 3 سنوات قطع غيار و18 شهر صيانة</li>\n \t<li>ستلايت مركزي لكامل العمارة</li>\n \t<li>السطح معزول عزل مائي وحراري</li>\n \t<li>كاميرات مراقبة عند مدخل العمارة والكراجات موصولة الى الستلايت المركزي لكل شقة</li>\n \t<li>كراج سيارة عدد (2) للمساحة 255 متر، عدد (1) للمساحة 216 متر</li>\n \t<li>غرفة خزين</li>\n \t<li>بئر ماء سعة 8 متر مع مضخة</li>\n \t<li>غرفة حارس</li>\n</ul>\nالأسعار:\n<ul>\n \t<li>مساحة 255 متر : الطابق الاول 290000 الف دينار</li>\n \t<li>\n</li></ul>\n<strong>ملاحظة ؛ – لمشاهدة الشقق مجانا – يرجى أخذ موعد مسبق</strong>\n\n<strong>دفع عمولة 2% في حال الشـــــــــراء</strong>\n\n&nbsp;",
