    "x_studio_property_information": "<h2>فلل شبه متلاصقة مقابل مدارس البكالوريا في دابوق</h2>\n<ul>\n \t<li>المساحة الاجمالية للارض 1479 م2</li>\n \t<li>المساحة الاجمالية للفيلا الشمالية 691 م2 والجنوبية 671 م2</li>\n</ul>\n<strong>مواصفات الفلل:</strong>\n<ul>\n \t<li>تتكون كل فيلا من 3 طوابق: طابق التسويه والأرضي والأول</li>\n \t<li>لكل فيلا موقف لسياراتين ومدخل خاص من مستوى الشارع</li>\n \t<li>ارتدادات جانبية 8 م على جميع الواجهات</li>\n \t<li>توفر حديقة بمساحة 500 م2 لكل فيلا</li>\n \t<li>حجر رويشد نخب اول لجميع الواجهات</li>\n \t<li>الابواب الداخلية والخارجية من خشب الجوز</li>\n \t<li>الرخام ايطالي للشمالية وتركي للجنوبية</li>\n \t<li>9 حمامات لكل فيلا نوع IDEAL STANDARD/ENGLAND</li>\n \t<li>الطابق الأول لكل فيلا يحتوي على اربعة غرف للنوم 2 ماستر بلاضافة الى غرفة جلوس ومطبخ</li>\n \t<li>الطابق الارضي يضم الصالونات والطعام ومطبخ مع ركن افطار الى جانب غرفة جلوس عائلية</li>\n \t<li>طابق التسوية يحتوي على غرفة نوم ماستر للضيوف، غرفة خادمه مع حمام، غرفة حارس مع حمام، صالة العاب، مطبخ وغرفة غسيل</li>\n \t<li>الدرج الرئيسي في كل فيلا من خشب الزان مع دربزين خشب وحديد</li>\n \t<li>مصعد Otis داخل كل فيلا.</li>\n \t<li>تكييف مركزي وتدفئة تحت البلاط على النظام الكهربائي ( Heat PUMP )</li>\n \t<li>تحكم مركزي عن بعد للمراقبة وتشغيل مختلف الانظمة الكهربائية والميكانيكية.</li>\n</ul>\nالسعر 900000 دينار\n<p dir=\"RTL\"><strong><span lang=\"AR-SA\">ملاحظة ؛ – لمشاهدة العقار مجانا – يرجى أخذ موعد مسبق</span></strong></p>\n<p dir=\"RTL\"><strong><span lang=\"AR-SA\">دفع عمولة 2% في حال الشـــــــــراء</span></strong></p>\n&nbsp;",
