    "x_studio_property_information": "<h2>شقق 200م أرضية بتشطيبات مميزة في خلدا</h2>\n<strong>منطقة هادئة ومخدومة&nbsp;</strong>\n\n<strong>صالون, معيشة, مطبخ نظام امريكي, حديقة كبيرة</strong>\n<strong>مدخل خاص, 3 نوم, 1 ماستر, غرفة خادمة</strong>\n\n<strong>\nالمواصفات:</strong>\n\n<strong>تدفئة مركزية</strong>\n<strong>أرضيات رخام&nbsp;</strong>\n<strong>مقطع ألمنيوم خاص&nbsp;</strong>\n<strong>أباجورات كهرباء</strong>\n<strong>ديكورات حبصن بورد وإنارة مخفية</strong>\n<strong>نظام صوتي لكامل الشقة</strong>\n<strong>حمامات معلقة بتصاميم خاصة</strong>\n<strong>غرفة خزين</strong>\n<strong>كراج</strong>\n\n<strong>شبه أرضي 200 متر مع حديقة كبيرة : 180 ألف دينار\nطابق ثاني 130 متر: 113 الف دينار</strong>\n<p dir=\"RTL\"><strong><span lang=\"AR-SA\">ملاحظة ؛ – لمشاهدة العقار مجانا – يرجى أخذ موعد مسبق</span></strong></p>\n<p dir=\"RTL\"><strong><span lang=\"AR-SA\">دفع عمولة 2% في حال الشـــــــــراء</span></strong></p>\n&nbsp;",
