    "x_studio_property_information": "<div class=\"o9v6fnle cxmmr5t8 oygrvhab hcukyx3x c1et5uql ii04i59q\">\n<h2 dir=\"auto\">شقق بإطلالة دائمة تحت الإنشاء في شارع السلام</h2>\n</div>\n<div dir=\"auto\"><strong>المساحات:</strong></div>\n<ul>\n \t<li dir=\"auto\">210 متر:&nbsp; 3 غرف نوم 1 ماستر</li>\n \t<li dir=\"auto\">230 متر:&nbsp; 4 غرف نوم 2 ماستر</li>\n</ul>\n<div class=\"o9v6fnle cxmmr5t8 oygrvhab hcukyx3x c1et5uql ii04i59q\">\n<div dir=\"auto\"><strong>مواصفات الشقق&nbsp; :</strong></div>\n</div>\n<div class=\"o9v6fnle cxmmr5t8 oygrvhab hcukyx3x c1et5uql ii04i59q\">\n<ul>\n \t<li dir=\"auto\">منطقة هادئ و مميزة ويقع المشروع ٣ شوارع</li>\n \t<li dir=\"auto\">حجر رويشد نخب اول معزول من الداخل و الخارج</li>\n \t<li dir=\"auto\">تم بناء الحجر بطريقة semi mechanical installation of stone للحجر ارتفاعه ٥١سم</li>\n \t<li dir=\"auto\">الشقق معزول بطبقتين طوب لإعطائها عزل مائي و حراري و صوتي</li>\n \t<li dir=\"auto\">وجود عازل بلسترين بين الحجر وطوب</li>\n \t<li dir=\"auto\">قصارة جاهزة من شركة لافارج</li>\n \t<li dir=\"auto\">طوب وربس جاهز شركة المناصير</li>\n \t<li dir=\"auto\">باطون جاهز من شركة لافارج كسر ٢٥٠</li>\n \t<li dir=\"auto\">جبسن بورد موديرن مع سبوتات وإنارة مخفية.</li>\n \t<li dir=\"auto\">تشطيبات فلل ورخام اورينتال ايطالي.</li>\n \t<li dir=\"auto\">غرف النوم باركيه اسباني نخب اول قياس ٢٣*١٢٣</li>\n \t<li dir=\"auto\">بورسلان نخب اول للحمامات</li>\n \t<li dir=\"auto\">أطقم حمامات فاخرة و ديكورات جميع الحمامات</li>\n \t<li dir=\"auto\">جميع الحمامات معزولة</li>\n \t<li dir=\"auto\">أباجورات كهرباء</li>\n \t<li dir=\"auto\">نياجر معلقه جروهي -خزائن حمامات - شور بوكس- رديترات سلم ستانلس للحمامات الماستر</li>\n \t<li dir=\"auto\">تأسيس مكيفات- ستاليت مركزي.</li>\n \t<li dir=\"auto\">أبواب جوز مميزة جداً</li>\n \t<li dir=\"auto\">أبواب أمان نوع تركي لمداخل الشقق</li>\n \t<li dir=\"auto\">الألمنيوم مقطع خاص عازل للحرارة والصوت دبل جلاس.</li>\n \t<li dir=\"auto\">مصعد astra ايطالي.</li>\n \t<li dir=\"auto\">كل شقة لها مخزن وكراج خاص بها.</li>\n \t<li dir=\"auto\">كامل العمارة معزولة.</li>\n \t<li dir=\"auto\">ستالايت مركزي</li>\n</ul>\n<strong>الأسعار:&nbsp;</strong>\n<ul>\n \t<li>طابق أرضي 210 متر 3 غرف نوم مع حديقة 200 متر : 145000 دينار</li>\n \t<li>طابق أول 210 متر 3 غرف نوم: 115000 دينار</li>\n \t<li>طابق أرضي 230 متر 4 غرف نوم مع حديقة 200 متر: 155000 دينار</li>\n \t<li>طابق أول 230 متر 4 غرف نوم : 125000 دينار</li>\n \t<li>طابق ثاني 230 متر 4 غرف نوم : 127000 دينار</li>\n \t<li>طابق ثالث 230 متر 4 غرف نوم : 129000 دينار</li>\n \t<li>طابق أخير 230 متر 4 غرف نوم مع رووف غير مبني : 142000 دينار</li>\n \t<li>\n</li></ul>\n<p dir=\"RTL\"><strong><span lang=\"AR-SA\">ملاحظة ؛ – لمشاهدة العقار مجانا – يرجى أخذ موعد مسبق</span></strong></p>\n<p dir=\"RTL\"><strong><span lang=\"AR-SA\">دفع عمولة 2% في حال الشـــــــــراء</span></strong></p>\n\n</div>\n<div class=\"o9v6fnle cxmmr5t8 oygrvhab hcukyx3x c1et5uql ii04i59q\"></div>\n<div class=\"o9v6fnle cxmmr5t8 oygrvhab hcukyx3x c1et5uql ii04i59q\">\n<div dir=\"auto\"></div>\n</div>",
