    "x_studio_property_information": "<div class=\"o9v6fnle cxmmr5t8 oygrvhab hcukyx3x c1et5uql ii04i59q\">\n<h2 dir=\"auto\">شقة طابقية 4 نوم مع حديقة كبيرة في دابوق</h2>\nبناية على شارعين بتصميم معماري مميز\nشقق طابقية 4 نوم مع مساحات خارجية بأسعار منافسة\n<div dir=\"auto\"><strong>مواصفات الشقق:</strong></div>\n<ul>\n \t<li dir=\"auto\">٤ غرف نوم جميعها ماستر بالإضافة الى غرفة ملابس للماستر الرئيسية</li>\n \t<li dir=\"auto\">الشقق معزول بطبقتين طوب لإعطائها عزل مائي و حراري و صوتي</li>\n \t<li dir=\"auto\">منطقة هادئ و مميزة محاطة بالفلل</li>\n \t<li dir=\"auto\">تدفئة تحت البلاط</li>\n \t<li dir=\"auto\">تكييف مركزي نوع LG</li>\n \t<li>home automation</li>\n \t<li>سماكة الجدران الخارجية ٥٣سم double block</li>\n \t<li>حجر مصري (سماحة ) نخب اول سماكة ٦سم معزول من الداخل و الخارج</li>\n \t<li>تم بناء الحجر بطريقة semi mechanical installation of stone</li>\n \t<li>قصارة جاهزة من شركة لافارج</li>\n \t<li>طوب وربس جاهز شركة المناصير</li>\n \t<li>باطون جاهز من شركة لافارج كسر ٢٥٠</li>\n \t<li>جبسن بورد موديرن مع سبوتات وإنارة مخفية.</li>\n \t<li>تشطيبات فلل ورخام ايطالي.</li>\n \t<li>غرف النوم باركيه اسباني نخب اول قياس ٦٠*١٢٠</li>\n \t<li>بورسلان نخب اول للحمامات قياس ٦٠*١٢٠</li>\n \t<li>أطقم حمامات فاخرة و ديكورات جميع الحمامات</li>\n \t<li>اباجورات كهرباء</li>\n \t<li>نياجر معلقه جروهي -خزائن حمامات - شور بوكس- رديترات سلم ستانلس للحمامات.</li>\n \t<li>ستاليت مركزي.</li>\n \t<li>أبواب جوز مميزة جداً</li>\n \t<li>أبواب أمان نوع تركي لمداخل الشقق</li>\n \t<li>الألمنيوم مقطع خاص عازل للحرارة والصوت دبل جلاس.</li>\n \t<li>مصعد astra ايطالي.</li>\n \t<li>كل شقة لها مخزن وكراج خاص بها.</li>\n \t<li>كامل العمارة معزولة.</li>\n</ul>\nالأسعار:\n<ul>\n \t<li>شبه ارضي B2 مع حديقة كبيرة 300م ومدخل خاص : 350000 دينار</li>\n</ul>\nالتسليم 5/2022\n<p dir=\"RTL\"><strong><span lang=\"AR-SA\">ملاحظة ؛ – لمشاهدة العقار مجانا – يرجى أخذ موعد مسبق</span></strong></p>\n<p dir=\"RTL\"><strong><span lang=\"AR-SA\">دفع عمولة 2% في حال الشـــــــــراء</span></strong></p>\n\n</div>",
