    "x_studio_property_information": "<h2>أخير مع رووف بإطلالة مميزة في تل الصنوبر</h2>\nقرب كرودور عبدون وطريق المطار\n250 متر دوبلكس بمصعد داخلي\n\n<strong>&nbsp;الشقق تتكون من :</strong>\n\nصالون ضيوف مع حمام - مطبخ - غرفة معيشة - غرفة أولاد مع حمام – غرفتين نوم ماستر مع حمام\nغرفة خادمة مع حمام - بلكون كبيرمع اطلالة مميزة\n\n<strong>مواصفات البناء:</strong>\n<ul>\n \t<li>تصميم خارجي رائع وتشطيبات داخلية على أعلى مستوى</li>\n \t<li>أفضل أنواع الحجر العجلوني نخب اول</li>\n \t<li>مصعد داخلي</li>\n \t<li>تشطيب فلل سوبر ديلوكس بجودة عالية</li>\n \t<li>تكييف مركزي حسب الطلب</li>\n \t<li>تدفئة تحت البلاط غاز (ROOM BY ROOM)</li>\n \t<li>ديكور جبسم بورد مودرن مع إنارات مخفية</li>\n \t<li>مصاعد حديثة بمواصفات عالية</li>\n \t<li>ارضيات الصالونات رخام</li>\n \t<li>أرضيات غرف النوم سيراميك اسباني</li>\n \t<li>الحمامات اطقم معلقة</li>\n \t<li>شور بوكس مقطع خاص</li>\n \t<li>المغاسل ايطالي مع خزائن فوم مميزة</li>\n \t<li>نظام إنتركم وكاميرا (Commax) مع حماية من السرقة</li>\n \t<li>العمارة معزولة عزل فوم سعودي بمواصفات عالية</li>\n \t<li>خزان ماء منفصل لكل شقة (بسعة 4 متر) + مضخة اتوماتيك</li>\n \t<li>الابواب الرئيسية خشب جوز صولد + الديكورات الخارجية (خشب جوز)</li>\n \t<li>اسقف البلكونة خشب افريكية مع انارة مخفية مميزة</li>\n \t<li>تأسيس فاير بليس غاز</li>\n \t<li>الألمنيوم دبل جلاس مقطع خاص سبيسر 14ملم (كاتم صوت)</li>\n \t<li>مستودع لكل شقة + موقف سيارات لكل شقة</li>\n \t<li>سطح العمارة معزول ضد الحرارة و الرطوبة ومبلط و مزود بخطوط ماء + كهرباء للخدمات</li>\n \t<li>تتميز الشقق بإطلالة رائعة ونافذة للشمس من جميع الجهات</li>\n</ul>\n<p dir=\"RTL\"><strong><span lang=\"AR-SA\">ملاحظة ؛ – لمشاهدة العقار مجانا – يرجى أخذ موعد مسبق</span></strong></p>\n<p dir=\"RTL\"><strong><span lang=\"AR-SA\">دفع عمولة 2% في حال الشـــــــــراء</span></strong></p>\n&nbsp;",
