    "x_studio_property_information": "<h2>مشروع ڤلل مستقلة بأجمل اطلالة في دابوق</h2>\n<ul>\n \t<li>مساحة البناء تتراوح بين 500م الى 600م لكل ڤيلا</li>\n \t<li>جميع الڤلل مشرقة ومضيئة طوال الوقت</li>\n</ul>\n<strong>المشروع مكون من 18 ڤيلا جميعها مستقلة</strong>\n<ul>\n \t<li>يبعد 5 دقائق عن دابوق و 3 دقائق عن الفحيص</li>\n \t<li>مصمم ليحافظ على الإطلالات الخضراء الموجودة في المشروع</li>\n \t<li>المشروع مسور ومحمي</li>\n \t<li>سند تسجيل منفصل بالارض (إبتداءً من 750م)</li>\n \t<li>خلف مدارس المشرق</li>\n</ul>\nمواصفات الڤلل:\n<ul>\n \t<li>نظام تدفئة تحت البلاط من مجموعة عزت مرجي</li>\n \t<li>تكييف مركزي&nbsp; \"Gree\"</li>\n \t<li>حجر عجلون نخب أول راكب \"ميكانيكياً\"</li>\n \t<li>أرضيات رخام عُماني بالصالونات</li>\n \t<li>أرضيات بورسلان اسباني لغرف النوم والحمامات</li>\n \t<li>مقطع ألمنيوم خاص 16م.م من \"الفقير\"</li>\n \t<li>نظام Smart Home بتحكم من الهاتف</li>\n \t<li>أطقم حمامات معلقة \"Ideal Standard\" وبطاريات \"Grohe\"</li>\n \t<li>نظام صوتي لكامل الڤيلا</li>\n \t<li>ديكورات جبصن بورد وانارات مخفية</li>\n \t<li>درج داخلي بتصميم مميز مع تأسيس مصعد</li>\n</ul>\nالطابق الأرضي:\n<ul>\n \t<li>مساحة مفتوحة بدون أعمدة مكونة من مطبخ واسع ومفتوح على غرفة المعيشة</li>\n \t<li>غرفة معيشة ذات واجهات كبيرة مفتوحة على الساحة الخارجية</li>\n \t<li>غرفة ضيوف وسفرة</li>\n</ul>\nالطابق الأول:\n<ul>\n \t<li>4 غرف نوم ماستر</li>\n \t<li>غرفة معيشة مع تراس واسع ذو إطلالة مميزة</li>\n</ul>\nطابق التسوية:\n<ul>\n \t<li>كراج يتسع لسيارتين</li>\n \t<li>مستودع</li>\n \t<li>غرفة خادمات</li>\n \t<li>غرفة غسيل</li>\n</ul>\nالسعر:\nابتداءاً من 650000 دينار\n\nالتسليم شهر 2024/12\n<p dir=\"RTL\"><strong><span lang=\"AR-SA\">ملاحظة ؛ – لمشاهدة العقار مجانا – يرجى أخذ موعد مسبق</span></strong></p>\n<p dir=\"RTL\"><strong><span lang=\"AR-SA\">دفع عمولة 2% في حال الشـــــــــراء</span></strong></p>",
