    "x_studio_property_information": "<div class=\"kvgmc6g5 cxmmr5t8 oygrvhab hcukyx3x c1et5uql ii04i59q\">\n<h2 dir=\"auto\"><strong>شقق مميزة 150 متر بإطلالة خلابة في الظهير</strong></h2>\nالظهير - خلف كازية المناصير الرئيسية - بالقرب من مدارس الخمائل - تبعد 3 دقائق عن طريق المطار\n\n</div>\n<div dir=\"auto\">\n<div class=\"o9v6fnle cxmmr5t8 oygrvhab hcukyx3x c1et5uql ii04i59q\">\n<div dir=\"auto\"><strong>المواصفات: </strong></div>\n<ul>\n \t<li>المشروع يتكون من 10 شقق مساحة كل شقة 150 مترمربع\nتتكون من : صالون - حمام ضيوف - غرفة معيشة - مطبخ امريكي - غرفتين اولاد - حمام اولاد - غرفة ماستر - مخزن - كراج مستقل لكل شقة .</li>\n \t<li>(حدائق - ترسات خارجية- رووف )</li>\n \t<li>تدفئة مركزية + تمديدات غاز مركزية</li>\n \t<li>نظام صوتي كامل لكل شقة</li>\n \t<li>زجاج عازل للصوت والحرارة</li>\n \t<li>واجهات بانوراما على مساحات واسعة</li>\n \t<li>حمامات معلقة</li>\n \t<li>أرضيات رخام + بورسلان فاخره</li>\n \t<li>منطقة يتوفر بها جميع الخدمات</li>\n \t<li>تشطيبات داخلية مميزة جدا</li>\n \t<li>تصميم خارجي رائع</li>\n</ul>\n<strong>الأسعار:</strong>\n<ul>\n \t<li>تسوية يمين مع حديقة 200 متر: 125000 دينار</li>\n \t<li>أرضي شمال مع تراس 100 متر: 115000 دينار</li>\n \t<li>طوابق متكررة : 105000 دينار</li>\n \t<li>أخير مع رووف (50 متر بناء + تراس 25 متر): 145000 دينار</li>\n</ul>\n<p dir=\"RTL\"><strong><span lang=\"AR-SA\">ملاحظة ؛ – لمشاهدة العقار مجانا – يرجى أخذ موعد مسبق</span></strong></p>\n<p dir=\"RTL\"><strong><span lang=\"AR-SA\">دفع عمولة 2% في حال الشـــــــــراء</span></strong></p>\n\n</div>\n</div>",
