    "x_studio_property_information": "<h2>188م بأرقى أحياء الرابية بسعر ممتاز</h2>\nحي هادئ ومخدوم\n\nالطابق الأول 188م :\n\nصالون, معيشة, 3 نوم (1) ماستر, مطبخ راكب,\nبلكونة عدد (2), غرفة خادمة مع حمام\n\nمطبخ راكب من \"طهبوب\"\nصالون واسع\nمعيشة كبيرة\nتدفئة مركزية\nخزائن بالحائط\nأرضيات سيراميك باركيه بالغرف\nمخزن\nكراج\n<p dir=\"RTL\"><strong><span lang=\"AR-SA\">ملاحظة ؛ – لمشاهدة العقار مجانا – يرجى أخذ موعد مسبق</span></strong></p>\n<p dir=\"RTL\"><strong><span lang=\"AR-SA\">دفع عمولة 2% في حال الشـــــــــراء</span></strong></p>",
