    "x_studio_property_information": "<h2>ڤلل متلاصقة بمواصفات خاصة على طريق المطار</h2>\nبالقرب من جامعة الشرق الأوسط وبمنطقة محاطة بالڤلل\n\nتبعد 15 دقيقة عن الدوار السابع\n\n<strong>المساحات&nbsp; :</strong>\n\nمساحة الارض : 600م (300م لكل ڤيلا)\n\nمساحة البناء : 454م\nتتكون من طابق تسوية 132م\nطابق أرضي 132م\nطابق أول 132م\nرووف 58م مع ترس لصالح الرووف مع ترس خدمات باجمالي مساحة تقريبية 100م\n\nكل ڤيلا مكونة من :\nصالونات, معيشة, مطبخ\n4 غرف نوم جميعها ماستر, برندة\nخزين, غرفة خادمة مع حمام\nبئر مياه 27م, غرفة ميكانيك وخدمات مسبح 10م\n\n<strong>المواصفات :</strong>\n\nحجر رويشد قاسي أزرق نخب أول\nتدفئة مركزية غاز بخزان مستقل لكل فيلا سعة 1750 لتر\nخرسانة مسلحة مصنعة اليا من خلال شركة الزهيري بقوة كسر 250\n\nتكييف مركزي باستعمال الوحدات المعلقة و مؤسس لكامل الفيلا\nتركيب كامل للارضي و الاول بقدرات (1/1.5/2) طن جودة عالية مع كفالة تسلم للمشتري\n\nالعزل السفلي باستعمال ثلاث وجوه شاملة مع الخيش من الاسفلت المذاب مع عزل بولسترين سعودي 3 سم للجدارن\nماء زجاج من الخارج مع طوب مزدوج لطابق التسوية مع فراغ عازل\nعزل صوتي مع استعمال طوب 20 سم مصمت للفصل بين اية مناطق اتصال مع الجدار لضمان العزل الصوتي\nألمنيوم مورد من شركة الومكس مقطع 14سم سماكات الزجاج دبل 5.5ملم و فراغ 14ملم\n\nسبوتات مستديرة مكفولة مع حبال اضوية ذات قدرة مزدوجة مكفولة ذات جودة عالية\nانتركم مع كاميرات و شاشات و فتح عن بعد و ابواب كراجات كهربائية\nمع تاسيس لنظام توفير و توليد طاقة شمسي و نظام 3 فاز\n\nنظام مراقبة بالكاميرات شامل DVR مع كفالات سارية كما سيتم تزويد كل فيلا بنظام تلفاز و ستالايت و اباريز USB &amp; DATA\nأبواب أمان خارجية مكفولة 10 سنوات, وأبواب PVC داخلية تركي نخب أول\n\nأرضيات رخام بالصالونات وبورسلان اسباني لغرف النوم\nحمامات معلقة, أطقم&nbsp; ( RAC / villeroy and boch / Ideal Standard ) او ما يعادلها\nجبسن بورد عالي الجودة مقاوم للحريق و الماء و الرطوبة بالمطبخ و بالحمامات الرئيسية\nنظام تدعيم يسمح للمشتري باجراء اي تغير على تصميم السقف حسب الحاجة مع ديكور اضافي على محيط الغرفة لدمج و احتواء النارة المخفية\n<p dir=\"RTL\"><strong><span lang=\"AR-SA\">ملاحظة ؛ – لمشاهدة العقار مجانا – يرجى أخذ موعد مسبق</span></strong></p>\n<p dir=\"RTL\"><strong><span lang=\"AR-SA\">دفع عمولة 2% في حال الشـــــــــراء</span></strong></p>\n&nbsp;",
