    "x_studio_property_information": "<h2>شقة طابق طابق اول 170 متر في مرج الحمام</h2>\nسوبر ديلوكس في مرج الحمام\nالبناية 10 شقق\n\nمواصفات الشقة: صالون,معيشة, بلكونة كبيرة, مطبخ راكب \"Universal\"\n3 غرف نوم - 1ماستر 3 حمامات (مع خزائن حمامات تركي اعلى مواصفات)\n\nباب امان تركي اعلى مواصفات ابواب الامان\nأبواب قشرة بلوط داخلي\nتدفئة راكبة ديزل\nكوندشن \"Sharp\" انفيرتر راكب عدد 2\nباركيه الماني راكب في غرفة نوم ماستر والممر وصالة المعيشة\nسخان شمسي راكب\n4 متر ماء مترين فوق ومترين تحت مع مضخة ايطالي\nكاميرات مراقبة عدد 4 خارجيات لحماية المنزل والعمارة\nتمديد تلفزيون بكل غرفة مع ستلايت جاهز\nديكورات جبسبورد لكامل الشقة\nانارة مخفية\nالمنيوم دبل مقطع خاص\nاباجورات كهرباء\nكراج لكل شقه\nمستودع لكل شقة\nالارضيات بورسلان اسباني\nالحمامات سيراميك اسباني\nشاوربوكس راكب\nانتركام واصل\nجميع الخدمات بما في ذلك صرف صحي، ماء، كهرباء، اتصالات فايبر الموقع\n<p dir=\"RTL\"><strong><span lang=\"AR-SA\">ملاحظة ؛ – لمشاهدة العقار مجانا – يرجى أخذ موعد مسبق</span></strong></p>\n<p dir=\"RTL\"><strong><span lang=\"AR-SA\">دفع عمولة 2% في حال الشـــــــــراء</span></strong></p>",
