    "x_studio_property_information": "<h2>أخير مع رووف بأعلى المواصفات في رجم عميش</h2>\n<strong>يبعد المشروع 3 دقائق عن تاج مول عبدون&nbsp;</strong>\n\n<strong>موقع ممتاز قرب الخدمات, البناية على 3 شوارع</strong>\n\n<strong>250 متر دوبلكس :</strong>\n<strong>الطابق الأخير : 200 (صالون, معيشة, مطبخ, 3 غرف نوم, بلكونة)</strong>\n<strong>الرووف&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;: 50 متر مبني (غرفة كبيرة, حمام, غرفة خادمة) + 80متر ترسات</strong>\n<div class=\"kvgmc6g5 cxmmr5t8 oygrvhab hcukyx3x c1et5uql ii04i59q\">\n<div dir=\"auto\"><strong><strong>مبنية بتصميم عصري وسط محيط اجتماعي مميز من الفلل والمباني الحديثة\nوالبنية التحتية الجديدة وبالمواصفات التالية:</strong></strong></div>\n</div>\n<div class=\"cxmmr5t8 oygrvhab hcukyx3x c1et5uql o9v6fnle ii04i59q\">\n<div dir=\"auto\"><strong>- أرضيات وجدران بورسلان فاخرة .</strong></div>\n<div dir=\"auto\"><strong>- حمامات معلقة (Vitra).</strong></div>\n<div dir=\"auto\"><strong>- بطاريات ( FIORE ) إيطالي .</strong></div>\n<div dir=\"auto\"><strong>- تدفئة على الغاز ضمن أعلى المواصفات مع تأسيس فاير بليس (Central Gas).</strong></div>\n<div dir=\"auto\"><strong>- بويلر (De Dietrich) (عزت مرجي).</strong></div>\n<div dir=\"auto\"><strong>- ديكورات جبسوم بورد.</strong></div>\n<div dir=\"auto\"><strong>- المفاتيح الكهربائية من (AVE) الإيطالية.</strong></div>\n<div dir=\"auto\"><strong>- شبابيك ألمنيوم (24) مم (Double Glaze) مقطع خاص\nعازلة للحرارة والصوت (شركة الفقير).</strong></div>\n<div dir=\"auto\"><strong>- أباجورات الشبابيك من الألمنيوم وتعمل على الكهرباء.</strong></div>\n<div dir=\"auto\"><strong>- تحتوي جميع الجدران الخارجية على طبقة عزل حراري وعزل صوتي\nضمن أعلى مستوى من مواصفات البناء الأردنية.</strong></div>\n<div dir=\"auto\"><strong>- تمديدات الستلايت داخلية.</strong></div>\n<div dir=\"auto\"><strong>- الأبواب ضمن احدث التصاميم العصرية ومصنوعة من خشب قشرة الجوز\nومزودة بأفضل أنواع الاكسسوارات الايطالية والتركية .</strong></div>\n</div>\n&nbsp;\n<p dir=\"RTL\"><strong><span lang=\"AR-SA\">ملاحظة ؛ – لمشاهدة العقار مجانا – يرجى أخذ موعد مسبق</span></strong></p>\n<p dir=\"RTL\"><strong><span lang=\"AR-SA\">دفع عمولة 2% في حال الشـــــــــراء</span></strong></p>",
