    "x_studio_property_information": "<h2>مساحات مميزة 3 نوم في جبل عمان</h2>\nقرب الدوار الثالث وبوليفارد العبدلي\n\nمتوفر مساحات 150متر (3 نوم), 110متر (2 نوم)\n<div dir=\"auto\">المواصفات :</div>\n<div dir=\"auto\">1- الجدران الخارجية سماكة 45 سم (جدار عزل مزدوج)</div>\n<div dir=\"auto\">2- الارضيات بورسلان اسباني</div>\n<div dir=\"auto\">3- الادراج رخام مقدوني</div>\n<div dir=\"auto\">4- سيراميك خشبي لغرف النوم والحمامات</div>\n<div dir=\"auto\">5- شبابيك ألمنيوم مقطع خاصDouble Glazed فراغ 14مم / 20مم</div>\n<div dir=\"auto\">6- اطقم حمامات معلقة</div>\n<div dir=\"auto\">7- شور بوكس Shower Box مع دوش بنظام Rain Shower Head</div>\n<div dir=\"auto\">8- نظام التدفئة والمطبخ بواسطة الغاز المركزي</div>\n<div dir=\"auto\">9- الكهرباء نظام AVE ايطالي</div>\n<div dir=\"auto\">10- اضاءة LED spots</div>\n<div dir=\"auto\">11- اسقف جيبسوم بورد Gypsum Board معلقه لكامل الشقة</div>\n<div dir=\"auto\">12- اسقف ديكورية stretch ceiling في مختلف الغرف</div>\n<div dir=\"auto\">13- اسقف حمامات مضيئة PVCعلى مساحة الحمام</div>\n<div dir=\"auto\">14- الابواب قشرة بلوط</div>\n<div dir=\"auto\">15- ابواب خاصة للحمامات (درفتين)</div>\n<div dir=\"auto\">16- نظام مركزي (ماستر) للتحكم بالأبجورات</div>\n<div dir=\"auto\">17- كرت مركزي (ماستر) للتحكم بالانارة</div>\n<div dir=\"auto\">18- شاشة انتركوم مع كاميرا نظام إسباني</div>\n<div dir=\"auto\">19- كاميرات حماية للمبنى من الخارج</div>\n<div dir=\"auto\">20- مدخل العمارة والمصعد وابواب الكراجات على نظام حماية بواسطة الكود Access Code</div>\n<div dir=\"auto\">21- كراجات مؤمنه بالكميرات</div>\n<div dir=\"auto\">22- ستلايت مركزي لجميع الشقق</div>\n<div dir=\"auto\">23- تأسيس فتحات للمكيفات (للكهرباء وتصريف المياه)</div>\n<div dir=\"auto\">24- تنكات ماء عدد 2 مع مضخات ايزي برس وعوامات كهرباء لكل شقة</div>\n<div dir=\"auto\">25- سخانات شمسيه يوناني نظام مرايا Solar Flame</div>\n<div dir=\"auto\">26- كراج خاص لكل شقة</div>\n<div dir=\"auto\">27- غرفة مستودع لكل شقة</div>\n<div dir=\"auto\">28- ديكور خشبي مميز حول و داخل المصعد</div>\n<div dir=\"auto\">\n\n29- نظام كاشف حركة للإنارة مداخل المصاعد\n\n</div>\n<div dir=\"auto\">\n\n<strong>ملاحظة ؛ – لمشاهدة شقق مجانا – يرجى أخذ موعد مسبق</strong>\n\n<strong>دفع عمولة 2% في حال الشـــــــــراء</strong>\n\n</div>",
