    "x_studio_property_information": "<h2 dir=\"auto\">شقق أرضية بمساحات مختلفة في أم أذينة</h2>\n<div dir=\"auto\">بموقع حيوي بأجمل مناطق أم أذينة</div>\n<div dir=\"auto\">\n\nقرب أبراج السادس وفندق CROWN PLAZA\n\n</div>\n<div dir=\"auto\">\n\nتشطيبات خاصة ويتوفر بالمشروع التالي :\n\n</div>\n<div dir=\"auto\">انترنت مركزي بقدرة عالية جدا وباشتراك شهري رمزي .</div>\n<div dir=\"auto\">كاميرات مراقبة للعمارة DAHUA</div>\n<div dir=\"auto\">انارة ذكية للمداخل كاملة تعمل على نظام الحركة</div>\n<div dir=\"auto\">الشقق مؤسسةبالكامل لتركيب نظام SMART HOME .</div>\n<div dir=\"auto\">ستلايت مركزي جاهز .</div>\n<div dir=\"auto\">المشروع مزود بمكيفات MEDIA 2021 باعلى المواصفات من الوكيل مباشرة .</div>\n<div dir=\"auto\">اعلى طرق العزل بالمشروع ( طوبار داخلي بالبيت كامل ) .</div>\n<div dir=\"auto\">عزل جدران بالكامل داخلي .</div>\n<div dir=\"auto\">حجر عجلون 50سم .</div>\n<div dir=\"auto\">ارضيات كلاكوتا اسباني + بلاط الحمامات اسباني .</div>\n<div dir=\"auto\">الالمنيوم مقطع الماني خاص + 14مل فراغ عازل للحرارة والصوت .</div>\n<div dir=\"auto\">انتركم DAHUA HIGH SMART SYSTEM .</div>\n<div dir=\"auto\">الصحي بالكامل ايطالي المنشأ .</div>\n<div dir=\"auto\">اطقم الحمامات IDEAL STANDERDS انجليزي من الوكيل مباشرة.</div>\n<div dir=\"auto\">شاور بوكس بالحمامات على نظام الاوتيلات مزود بالسيكوريت .</div>\n<div dir=\"auto\">الابواب الرئيسية ابواب امان باعلى المعايير والكقاءة عازل للحريق والصوت .</div>\n<div dir=\"auto\">الابواب الداخلية قشرة بلوط محلي الصنع وزن ثقيل .</div>\n<div dir=\"auto\">شاشات DAHUA داخلية للشقق مزودة بالعديد من الانظمة .</div>\n<div dir=\"auto\">اباجورات داخل الجدران على النظام الحديث .</div>\n<div dir=\"auto\">اغطية VBONE احدث الانواع + القواطع ABB هولندي .</div>\n<div dir=\"auto\">واجهات المشروع بتصميم هندسي كامل و CW على كامل المشروع.</div>\n<div dir=\"auto\">تاسيس مزودات كهربائية لكل كراج سيارة لشحن السيارات الكهربائية .</div>\n<div dir=\"auto\"></div>\n<div dir=\"auto\">\n<div dir=\"auto\">شقق ارضية دوبلكس مع ترسات ومداخل مستقلة مساحة 180-178متر\nالسعر : 1000 د/للمتر\nمع إمكانية فصل كل طابق لشقة منفصلة (78-80متر)</div>\n<div dir=\"auto\"></div>\n<div dir=\"auto\">\n<p dir=\"RTL\"><strong><span lang=\"AR-SA\">ملاحظة ؛ – لمشاهدة العقار مجانا – يرجى أخذ موعد مسبق</span></strong></p>\n<p dir=\"RTL\"><strong><span lang=\"AR-SA\">دفع عمولة 2% في حال الشـــــــــراء</span></strong></p>\n\n</div>\n</div>",
