    "x_studio_property_information": "<h2>ڤلل مميزة بأسعار منافسة ضمن كومپاوند مغلق</h2>\nعمان، ناعور، شارع السلام - يبعد عن الدوار السابع 15 كيلو - 10 دقائق\n\nمشروع ڤلل&nbsp; بتصاميم عصرية في أجمل المناطق ذات الطبيعة الخلابة والهادئة،\nوتم بناؤها بأفضل المواصفات والتشطيبات الفاخرة بإشراف كادر هندسي مختص لنقدم لكم بيت العمر\n\nميزات المشروع العامة :\n- ﻣﻮﻗﻊ ﻣﻤﻴﺰ ﺑﻤﻨﺎﻇﺮ اﻟﻄﺒﻴﻌﺔ اﻟﺨﻀﺮاء الهادئة\n- ﻣﻨﻄﻘﺔ ﺧﺎﺻﺔ ﺑﺄﺻﺤﺎب اﻟﻔﻠﻞ( كومباوند)\n- ﻣﻨﻄﻘﺔ ﻣﺤﻤﻴﺔ ﺑﻜﺎﻣﻴﺮات ﻣﺮاﻗﺒﺔ وﺣﺮاﺳﺔ على ﻣﺪار 24 ﺳﺎﻋﺔ\n- ﻣﻨﻄﻘﺔ ﻣﺰودة ﺑﻤﺮاﻓﻖ ﻋﺎﻣﺔ : ﻣﺴﺠﺪ وحديقة وﻣﻼﻋﺐ أﻃﻔﺎل و ﻗﺎﻋﺎت اﺟﺘﻤﺎﻋﺎت\n- ﺑﻨﻴﺔ ﺗﺤﺘﻴﺔ ﻣﺘﻜﺎﻣﻠﺔ ، ﺧﺪﻣﺎت ﻛﻬﺮﺑﺎء وﻣﺎء وﺻﺮف ﺻﺤﻲ و ﺷﻮارع ﻣﻌﺒﺪة\n- شوارع داخليه بعرض 10_14_20 م\n\nأسعار منافسة بنظام دفعات مريح :\nالدفعه الأولى 10٪؜ مع إمكانية التقسيط لمده تصل الى 20 سنة\n\nالتشطيبات :\n- ارتفاع الأسقف 3.64 متر\n- سماكة الجدران الداخلية 40 سم معزول بجدارين طوب و فوم للعزل الحراري والمائي\n- حجر الضفة بيت فجار مضاف اليه مواد خاصة للعزل المائي\n- تأسيس مصعد\n- ابواب مقاومة للحريق\n- بئر ماء 10 متر مكعب\n- مقطع ألمنيوم دبل جلاس 14 سم مع فراغ 12 ملم بين الزجاج\n- الطاقة الشمسية سمارت هوم تكييف مركزي تدفئة مركزية على الغاز\n\nالمساحات والأسعار :\n\n- الڤلل المتلاصقة على أرض 620 متر&nbsp; (مساحة البناء 300 متر دوبلكس ‏‎المساحة الخارجية من 135 إلى 215 متر ‏‎ تبدأ الأسعار من 300 ألف دينار)\n<p dir=\"RTL\"><strong><span lang=\"AR-SA\">ملاحظة ؛ – لمشاهدة العقار مجانا – يرجى أخذ موعد مسبق</span></strong></p>\n<p dir=\"RTL\"><strong><span lang=\"AR-SA\">دفع عمولة 2% في حال الشـــــــــراء</span></strong></p>",
