    "x_studio_property_information": "<h2 dir=\"auto\">شقق طابقية بإطلالة مميزة ودائمة في حجارة النوابلسة</h2>\nتنظيم الارض سكن خاص نظام ڤلل\nأعلى مواصفات التشطيب بإطلالة مميزة ودائمة\n<div dir=\"auto\">بمساحات 350 - 360 - 560 متر</div>\n<div dir=\"auto\"></div>\n<div dir=\"auto\">&nbsp;صالون ضيوف مع حمام ضيف - غرفة معيشة- مطبخ مع ( ديرتي كتشن )\n4 غرف نوم ماستر - غرفة خادمة مع حمام - بلكون كبير باطلالة مميزة</div>\n<div dir=\"auto\"></div>\n<div dir=\"auto\">مواصفات البناء:</div>\n<div dir=\"auto\"></div>\n<div dir=\"auto\">أفضل أنواع الحجر العجلوني نخب اول.</div>\n<div dir=\"auto\">تكييف مركزي (ROOM BY ROOM)</div>\n<div dir=\"auto\">تدفئة تحت البلاط (ROOM BY ROOM)</div>\n<div dir=\"auto\">ديكور جبسن بورد مودرن مع نظام إنارات عصرية رائعه.</div>\n<div dir=\"auto\">مصاعد ايطالية حديثة بمواصفات عالية .</div>\n<div dir=\"auto\">ارضيات الصالونات رخام كريما بيج سماكة 2سم .</div>\n<div dir=\"auto\">أرضيات غرف النوم بورسلان اسباني .</div>\n<div dir=\"auto\">الحمامات اطقم معلقة ( ROCA ) اسباني.</div>\n<div dir=\"auto\">\n\nرين شاور سمارت GROHE + خلاطات سمارت GROHE\n\n</div>\n<div dir=\"auto\">الخدمات :-</div>\n<div dir=\"auto\">سطح العمارة معزول ضد الحرارة و الرطوبة ومبلط ومزود بخطوط ماء + كهرباء للخدمات\nستلايت راكب لجميع الشقق\nكراجات مغلقة مع بوابة كهربائية ولكل شقه ريموت عدد2\nلكل شقه كراج عدد2\nمستودع لكل شقة</div>\n<div dir=\"auto\"></div>\n<div dir=\"auto\">\n\nالأسعار :\n\n</div>\n<div dir=\"auto\">التسوية الثانية 560م مع مسبح داخلي وحديقة كبيرة 250م : 600000 دينار\nشبه أرضي 350م مع حديقة كبيرة 140م : 390000 دينار</div>\n<div dir=\"auto\">التسوية الثانية 360م مع مسبح وحديقة كبيرة 530م : 495000 دينار\nشبه أرضي 360م مع حديقة كبيرة 245م : 360000 دينار\nالطابق الأرضي 360م مع ترس كبير 110م : 430000 دينار</div>\n<div dir=\"auto\">\n\n<strong>ملاحظة ؛ – لمشاهدة الفلل مجانا – يرجى أخذ موعد مسبق</strong>\n\n<strong>دفع عمولة 2% في حال الشـــــــــراء</strong>\n\n</div>\n<div dir=\"auto\"></div>",
