    "x_studio_property_information": "<h2>شقق أرضية بأعلى المواصفات في ضاحية النخيل</h2>\nيتكون المشروع من (9) شقق بمساحات مختلفة (190-200-210-250-260) متر مربع\n\n• حجر البناء نخب أول.\n• واجهات زجاجية مميزة .\n• يتم عزل المبنى عزل حراري ومائي وضمن اعلى المواصفات\n\nالمواصفات الفنية:\n• أرضيات رخام إيطالي ( اورينتال ) للصالونات والمعيشه\n• ارضيات بورسلان باركيه لغرف النوم\n• حمامات معلقة فاخره. + شاور بوكس راكب\n• بطاريات إيطالي فاخره\n• تدفئه تحت البلاط على الغاز وضمن اعلى المواصفات\n• تأسيس تكييف في جميع الغرف\n• ديكورات جبسوم بورد بتصميم عصري مع اناره (LED PHILIPS)\n• المقابس والمفاتيح الكهربائية (AVE) الإيطالية\n• شبابيك ألمنيوم (24) مم (Double Glaze) مقطع خاص وعازلة للحرارة والصوت\n• أباجورات الشبابيك من الألمنيوم وتعمل على الكهرباء\n• الأبواب مصنوعه من خشب قشرة الجوز ومزوده بأفضل أنواع الاكسسوارات الايطاليه والتركيه\n• أبواب رئيسيه امان عازله للصوت والحراره ومعالجه ضد الماء\n• تحتوي جميع الطوابق على عزل حراري ( ارضيات + اسقف )\n• تحتوي جميع الجدران الخارجيه على طبقة عزل حراري وعزل صوتي وعزل مائي\n• تمديدات الستلايت داخلية\n• خزانات مياه (2+2) متر مكعب في الطابق السفلي وعلى السطح مع مضخة تزويد اوتوماتيكيه\n• المشروع مزود بنظام غاز مركزي لأغراض التدفئة والطبخ والماء الساخن مع ساعة غاز منفصلة لكل شقة وتأسيس فيربليس\n• موقف خاص لكل شقه + مستودع\n\nالشقق المتوفرة :\n\n• شبه ارضيه مساحة 190 متر مع حديقه 250 متر : 195000 دينار\n• ارضيه مساحة 210 متر مع تراس 70 متر مع كراج مستقل : 230000 دينار\n• ارضيه مساحة 200 متر مع تراس 70 متر مع كراج مستقل : 210000 دينار\n• طابق اول+ثاني مساحة 210 متر : 175000 دينار\n• طابق اول+ ثاني مساحة 200 متر : 170000 دينار\n• طابق ثالث 210 متر + روف 50 متر + تراس 80 متر : 225000 دينار\n\n<strong>ملاحظة ؛ – لمشاهدة شقق مجانا – يرجى أخذ موعد مسبق</strong>\n\n<strong>دفع عمولة 2% في حال الشـــــــــراء</strong>",
