    "x_studio_property_information": "<h2>ڤيلا متلاصقة بتشطيبات خاصة في خلدا</h2>\nطابق التسوية 69م :&nbsp; &nbsp;مكون من غرفتين بويلر وديزل وغرفتين خزين وغرفة خادمة مع حمام.\n\nالطابق الارضي 140م :غرفة ضيوف كبيرة مع ديكورات فاخرة ، وحمام فاخر مع منطقة مغاسل ، مطبخ من شركة \"جورسال\" خشب لامينيت وأسطح كوريان امريكي متصلة مع غرفة جلوس صغيرة ومطلة على تراس خارجي كبير يحتوي على مظلة بيرجولا وشلال ماء ديكوري\n\nالطابق الاول 140م : 3 غرف نوم، 2 ماستر احدى الغرف بها غرفة ملابس مستقلة dressing room ومجهزة بالرفوف والجوارير والاكسسوارات ومتصلة ببرندة خارجيه. الغرفة الثانية بها خزانة حائط راكبة والغرفة الثالثة يوجد تأسيس لخزانة حائط . كما يوجد غرفة جلوس متصلة ببرندة خارجيه\n\nطابق الرووف 92م :غرفة نوم رئيسية كبيرة مع غرفة ملابس مستقلة وحمام كبير مجدد بالكامل وتراس خارجي\n\nالمواصفات :\n\nتكييف مركزي\nتدفئة تحت البلاط\nديكورات فاخرة في الصالون\nديكورات جبسم بورد في جميع الغرف والمطبخ\nمطبخ جديد فاخر\nاباجورات تعمل على الكهرباء\nبئر ماء ١٢ متر\nكراج مستقل مع مظلة وبوابة اتوماتيكية تعمل بالريموت\nومقاطع المنيوم دبل جلاس قبة سماوية في منتصف المنزل\nمظلة بيرجولا\nسخان ماء شمسي\n\n<strong>ملاحظة ؛ – لمشاهدة شقق مجانا – يرجى أخذ موعد مسبق</strong>\n\n<strong>دفع عمولة 2% في حال الشـــــــــراء</strong>",
