    "x_studio_price_prefix": false,
    "x_studio_property_information": "<h2>ڤلل مميزة بأجمل مناطق رجم عميش</h2>\n<strong>وصف الموقع:</strong>\n\nيقع في قلب عمان ضمن محيط مميز في أجمل مناطق السكن الخاص الخالي من البنايات السكنية\nفي منطقة رجم عميش، على ارتفاع 950 متر عن سطح البحر في أعلى قمم عمان\n\n<strong>مواصفات البناء الخارجي:&nbsp;</strong>\n<ul>\n \t<li>واجهة بناء مميزة وتصميم هندسي داخلي وخارجي مميز.</li>\n \t<li>حجر البناء رويشد نحب أول عالي القساوة.</li>\n \t<li>واجهات زجاجية مميزة على إطلالة خلابة واستخدام أحدث التكنولوجيا الزجاجية في العالم (LE Glass).</li>\n \t<li>أعلى معايير العزل حيث يحتوي كل جدار وكل سقف على طبقة من الفوم الرفنسي لتحقيق أكبر عزل حراري وصوتي ومائي لضمان أعلى مستويات الراحة في المنزل وتوفير الطاقة.</li>\n</ul>\n&nbsp;\n<ul>\n \t<li>الطابق الأرضي 190 متر: صالة كبيرة، غرفة طعام، معيشة منفصلة، مطبخ، غرفة غسيل، مخزن، وغرفة خادمة</li>\n \t<li>الطابق الأول 150 متر: 4 غرف نوم (2 ماستر)، غرفة معيشة، حمام ، تراسات عدد 2</li>\n \t<li>بالإضافة إلى مساحات خارجية وحدائق كبيرة جداً مع بركة سباحة لكل فيلا وبطريقة لم يسبق لها مثيل في العاصمة عمان.</li>\n</ul>\n<strong>المواصفات الفنية:&nbsp;</strong>\n<ul>\n \t<li>تم تزويد الصالونات بأفخم ,اجود أنواع الأرضيات إسبانية الصنع وبأكبر المقاسات المتوفرة.</li>\n \t<li>سيراميك درجة A&nbsp; للحمامات والمطابخ والمطابخ وأرضيات غرف النوم</li>\n \t<li>أرقى الماركات العالمية لأطقم الحمامات المعلقة (Ideal Standard)</li>\n \t<li>بطاريات جروهي في جميع الحمامات</li>\n \t<li>نظام تكييف مركزي لكل فيلا بأجود الماركات العالمية</li>\n \t<li>أسقف جبصن بورد معلقة في كامل الفيلا بأرقى التصاميم وأحدثها من خبراء التصميم الداخلي لضمان نمط حياة فارهة ومريحة</li>\n \t<li>المقابس والمفاتيح الكهربائية من (ِAVE) الإيطالية</li>\n \t<li>أفضل الشبكات الإيطالية للمياه والتدفئة (Under Floor) موزعة في كامل مساحات المنزل وبكفالة 20 سنة</li>\n \t<li>أكبر مقاطع الألمنيوم بأعلى معايير العزل العالمية وباستخدام (LE Glass) وبسماكة زجاج 26 سم لتحقيق أعلى قدرة عزل مائي وحراري وصوتي.</li>\n \t<li>تم تجهيز كل شبابيك المنزا بأباجورات من الألمنيوم والفوم العازل</li>\n \t<li>أجود أنواع الأبواب.</li>\n \t<li>تم اعتماد نظام (DASPA) الصوتي ليصل إلى كل ركن من أركان المنزل ويعمل بعدة مداخل.</li>\n \t<li>تم تزويد كل فيلا بنظام غاز مركزي مستقل لأغراض التدفئة والمطبخ والماء الساخن و Fire Place</li>\n \t<li>بويلرات بيازي الإيطالية بكفالة 10 سنوات</li>\n \t<li>نظام (Home Automation) لكامل الفيلا للتحكم بالفيلا عن بعد</li>\n \t<li>نظام توليد طاقة شمسية مستقل لكل فيلا.</li>\n</ul>\nالتسليم شهر 5/2023\n<p dir=\"RTL\"><strong><span lang=\"AR-SA\">ملاحظة ؛ – لمشاهدة العقار مجانا – يرجى أخذ موعد مسبق</span></strong></p>\n<p dir=\"RTL\"><strong><span lang=\"AR-SA\">دفع عمولة 2% في حال الشـــــــــراء</span></strong></p>",
