    "x_studio_property_information": "<div class=\"x11i5rnm xat24cr x1mh8g0r x1vvkbs xdj266r x126k92a\">\n<h2 dir=\"auto\">شقق طابقية 360م بموقع مميز في الظهير</h2>\n<div dir=\"auto\">\n\nتشطيبات مميزة وبديكورات عصرية\n\n</div>\n</div>\n<div class=\"x11i5rnm xat24cr x1mh8g0r x1vvkbs xtlvy1s x126k92a\">\n<div dir=\"auto\">\n\nتتكون الشقق من:\n\n</div>\n<div dir=\"auto\">4 نوم (4 ماستر) ، 5 حمامات ، صالة و صالون ، مطبخ ، غرفة خادمة ، برندة</div>\n</div>\n<div class=\"x11i5rnm xat24cr x1mh8g0r x1vvkbs xtlvy1s x126k92a\">\n<div dir=\"auto\">\n\nالبناء مكون من 4 شقق فقط\n\n</div>\n<div dir=\"auto\">\n\nالمواصفات :\n\n</div>\n</div>\n<div class=\"x11i5rnm xat24cr x1mh8g0r x1vvkbs xtlvy1s x126k92a\">\n<div dir=\"auto\">اطقم حمامات بطاريات ideal stander بمواصفات اوروبية</div>\n<div dir=\"auto\">المنيوم مقطع خاص PVC عازل للصوت</div>\n<div dir=\"auto\">ابواب داخلية خشب طبيعي</div>\n<div dir=\"auto\">عزل جدران المبنى بمادة الفوم</div>\n<div dir=\"auto\">بلاط حمامات و ارضيات الغرف اسباني نخب اول</div>\n<div dir=\"auto\">نظام تدفئة غاز underfloor ايطالي ذات مواصفات عالية الجودة</div>\n<div dir=\"auto\">بامكانية التحكم بكل غرفة بالجهاز الخاص بها</div>\n<div dir=\"auto\">ابواب امان رئيسية للشقق</div>\n<div dir=\"auto\">كاميرات مراقبة للشقق الارضية</div>\n<div dir=\"auto\">حجر مصري ذي جودة عالية</div>\n<div dir=\"auto\">ارضيات الصالونات و غرفة المعيشة و المطبخ رخام كريما</div>\n<div dir=\"auto\">مارفل 2cm 60*60</div>\n<div dir=\"auto\">جبسن بورد مع انارة لكامل الشقة</div>\n<div dir=\"auto\">انتركم كاميرا على المدخل الرئيسي و رمز لدخول العمارة</div>\n<div dir=\"auto\">عدد المواقف لكل شقة 2</div>\n<div dir=\"auto\">ساتالايت راكب لكل الشقق</div>\n<div dir=\"auto\">تاسيس نحاس molar للتكيف</div>\n<div dir=\"auto\">\n\nمفاتيح كهرباء legrand\n\nالأسعار :\n\n</div>\n<div dir=\"auto\">شبه أرضي 280م داخلي مع حديقة كبيرة وكراج مستقل : 330000 دينار\nطابق أرضي 360م مع حدائق أمامية وخلفية : 420000 دينار\nطابق أول 360م : 390000 دينار\nطابق الرووف 180م داخلي+180م خارجي : 330000 دينار</div>\n<div dir=\"auto\">\n<p dir=\"RTL\"><strong><span lang=\"AR-SA\">ملاحظة ؛ – لمشاهدة العقار مجانا – يرجى أخذ موعد مسبق</span></strong></p>\n<p dir=\"RTL\"><strong><span lang=\"AR-SA\">دفع عمولة 2% في حال الشـــــــــراء</span></strong></p>\n\n</div>\n</div>",
